INSERT INTO public.cart_line_item VALUES ('cali_01JXX4PPVFYCV28FWH22TRDTDD', 'cart_01JXX4PNQAR9S5B0RPWEKXSM6P', 'Vampire Tetra', '16.5cm', 'http://localhost:9000/static/1750036712020-db52e8_67ec338790bd443786ef774706560e4d_mv2_d_3024_2410_s_4_2_540x.webp', 1, 'variant_01JXV522X593M3Z4EDRBCQ2WAH', 'prod_01JXV522KKJK3NET310DCARK6C', 'Vampire Tetra', 'The Vampire Tetra is a remarkable characin, but it is not your typical tetra. One look at the mouth of this fish and there will be no doubt that the Payara is a vicious carnivore. This incredible fish has two large fangs on its lower jaw. These fangs can be 4 to 6 inches long. In fact, the two main lower teeth are so long that upper jaw has holes for them to fit into. Payara are fast and aggressive feeders. These fish usually swallow their prey whole but will sometimes chop them into smaller, bite-sized pieces. They get large, too, so if you want to keep one as a pet, be prepared to have a very high feeder-fish bill. This fish can reach up to about 4 feet (117 cm) in length and weigh up to 40 lbs (18 kg), though aquarium specimens are usually only reach a quarter of that size, around 12 inches.', 'Payara', 'fish', NULL, 'vampire-tetra', NULL, NULL, '16.5cm', NULL, false, true, false, NULL, NULL, 132, '{"value": "132", "precision": 20}', '{}', '2025-06-16 15:50:48.433-04', '2025-06-16 15:50:48.433-04', NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', false, false);
