INSERT INTO public.order_line_item VALUES ('ordli_01JXX47R858MMETB95A5DEZVRY', NULL, 'Persian', 'Male / Peke-Face / 3-4months', 'http://localhost:9000/static/1750076974437-aee6ea2a265a433801352d897d34c00c.jpg', 'variant_01JXWBETPRC9TC68QVVMNDCBRV', 'prod_01JXWBESRMH3TY0AND8X6Y776F', 'Persian', 'Persian (Felis catus)
Care Level: High (demanding grooming needs)
Temperament: Calm, affectionate, regal
Diet: Special kibble shape (brachycephalic-friendly)
Lifespan: 12–16 years
Weight: 7–12 lbs (3–5.4 kg)
Distinct Features: Ultra-flat face (peke-faced), long luxurious coat, massive round eyes

What We Love About This Breed:
➤ Living plush toy – Iconic fluffy appearance with a sweet demeanor
➤ Quiet royalty – Prefers lounging over mischief (ideal apartment cat)
➤ Over 80 color varieties – From snowy white to "chinchilla silver"
➤ The ultimate lap cat – Will cuddle for hours without fuss

The Persian is the quintessential show cat, with two facial types:

Traditional ("Doll Face") – Less extreme, historical look

Ultra-typed ("Peke Face") – Very flat, requires extra care

Critical Care Requirements:
✧ Daily grooming – 30+ mins to prevent life-threatening mats
✧ Eye wiping – 2–3x/day to prevent tear staining (use vet-approved wipes)
✧ Air-conditioned environment – Heatstroke risk due to short airways


Ideal For: Dedicated owners willing to commit to daily maintenance for a majestic companion.

History Tidbit: First exhibited at the 1871 London Crystal Palace show—Queen Victoria owned two blue Persians!', NULL, 'cat', NULL, 'persian', NULL, NULL, 'Male / Peke-Face / 3-4months', NULL, false, true, false, NULL, NULL, 1800, '{"value": "1800", "precision": 20}', '{}', '2025-06-16 15:42:38.358-04', '2025-06-16 15:42:38.358-04', NULL, false, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', false);
INSERT INTO public.order_line_item VALUES ('ordli_01JXX4S2CXP6ZX64GYW6BYW91F', NULL, 'Vampire Tetra', '16.5cm', 'http://localhost:9000/static/1750036712020-db52e8_67ec338790bd443786ef774706560e4d_mv2_d_3024_2410_s_4_2_540x.webp', 'variant_01JXV522X593M3Z4EDRBCQ2WAH', 'prod_01JXV522KKJK3NET310DCARK6C', 'Vampire Tetra', 'The Vampire Tetra is a remarkable characin, but it is not your typical tetra. One look at the mouth of this fish and there will be no doubt that the Payara is a vicious carnivore. This incredible fish has two large fangs on its lower jaw. These fangs can be 4 to 6 inches long. In fact, the two main lower teeth are so long that upper jaw has holes for them to fit into. Payara are fast and aggressive feeders. These fish usually swallow their prey whole but will sometimes chop them into smaller, bite-sized pieces. They get large, too, so if you want to keep one as a pet, be prepared to have a very high feeder-fish bill. This fish can reach up to about 4 feet (117 cm) in length and weigh up to 40 lbs (18 kg), though aquarium specimens are usually only reach a quarter of that size, around 12 inches.', 'Payara', 'fish', NULL, 'vampire-tetra', NULL, NULL, '16.5cm', NULL, false, true, false, NULL, NULL, 132, '{"value": "132", "precision": 20}', '{}', '2025-06-16 15:52:05.797-04', '2025-06-16 15:52:05.797-04', NULL, false, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', false);


