INSERT INTO public.product VALUES ('prod_01JXT3RBR7PEZ8R6RA1HYPM2X8', 'Electric Blue Day Gecko', 'electric-blue-day-gecko', '', 'The Electric Blue Day Gecko is a stunningly vibrant and active species, famous for its brilliant iridescent blue coloration. These diurnal geckos are a popular choice for their striking appearance and lively behavior, making them a beautiful addition to a well-planted terrarium.', false, 'published', 'http://localhost:9000/static/1750001790604-electric-blue-day-gecko-v0-x9afivggw5ke1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXDC61Z3VEKERK9XR8DRRZG', true, NULL, '2025-06-15 11:36:30.75-04', '2025-06-16 18:24:33.165-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXT6TYD50X9210TW4RDTYWWX', 'Aldabra Giant Tortoise', 'aldabra-giant-tortoise', '', 'The Aldabra Giant Tortoise is one of the largest tortoise species in the world, known for its immense size, impressive longevity, and docile nature. These majestic reptiles make a truly long-term commitment, often living for over a century and requiring significant space and specialized care.', false, 'published', 'http://localhost:9000/static/1750005020850-CFneRUbCbOon2vEimXakXQSJVw4m6VnMhqkF96Gzxu4.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 12:30:21.169-04', '2025-06-15 12:30:21.169-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXT7A017SVSW7BZH5B4XSQZH', 'Galápagos Tortoise', 'galapagos-tortoise', '', 'The Galápagos Tortoise is an iconic giant, native to the Galápagos Islands and among the largest living land tortoises in the world. Renowned for their incredible longevity and significant role in their ecosystem, these magnificent reptiles are a testament to natural history, requiring specialized long-term care due to their size and lifespan.', false, 'published', 'http://localhost:9000/static/1750005514173-UqV4w4Xji3H9PlzZGpHD0Rw5IKHDubxzeoHv05YaGnE.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 12:38:34.302-04', '2025-06-15 12:38:34.303-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXT87ZMMSGKGJJPWG45KGHY3', 'Radiated Tortoise', 'radiated-tortoise', '', 'The Radiated Tortoise is a visually striking and highly prized tortoise species, celebrated for its unique star-burst patterns emanating from the center of each scute on its domed shell. Native to Madagascar, these long-lived and gentle reptiles are a popular choice among enthusiasts for their beauty and calm temperament.', false, 'published', 'http://localhost:9000/static/1750006496781-God5fpHn0Z-HS_aK4HLf6YGRey9b8B681HbrEZQ15GU.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 12:54:56.951-04', '2025-06-15 12:54:56.951-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXT8HHQVJARMAY257ZZSRYT5', 'Ploughshare Tortoise', 'ploughshare-tortoise', '', 'The Ploughshare Tortoise is an exceptionally rare and critically endangered species, highly prized for its distinctive, shield-like carapace and prominent gular scute. Native to Madagascar, these tortoises are among the most sought-after and legally protected reptiles, representing a significant conservation priority due to their extreme rarity.', false, 'published', 'http://localhost:9000/static/1750006810316-d43ge56ncb151.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 13:00:10.371-04', '2025-06-15 13:00:10.371-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXT9CGS5A9TNY9NS2JYMN5PE', 'Indian Star Tortoise', 'indian-star-tortoise', '', 'The Indian Star Tortoise is a popular and visually captivating species, recognized by its distinctive, intricate star-like patterns on its dark shell. Native to dry grasslands and scrub forests, these medium-sized tortoises are known for their charming appearance and relatively manageable care requirements, making them a favored choice among tortoise enthusiasts.', false, 'published', 'http://localhost:9000/static/1750007693932-xn1a0ejgco851.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 13:14:54.161-04', '2025-06-15 13:14:54.161-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXT9TB88R5X91D721XD7K1AJ', 'Hyacinth Macaw', 'hyacinth-macaw', '', 'The Hyacinth Macaw is the largest and arguably most striking of all parrots, instantly recognizable by its magnificent, deep cobalt-blue plumage and vibrant yellow eye-rings. Known for their gentle and affectionate nature, these intelligent and social birds are a truly exceptional companion for dedicated avian enthusiasts.', false, 'published', 'http://localhost:9000/static/1750008146902-hyacinth-macaw-v0-q6bu1lurpkwd1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 13:22:27.253-04', '2025-06-15 13:22:27.253-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXRMYV16S5WA7343W5FXBHM0', 'Medusa T-Shirt', 't-shirt', NULL, 'Reimagine the feeling of a classic T-shirt. With our cotton T-shirts, everyday essentials no longer have to be ordinary.', false, 'published', 'https://medusa-public-images.s3.eu-west-1.amazonaws.com/tee-black-front.png', '400', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-14 21:58:39.929-04', '2025-06-15 18:00:15.188-04', '2025-06-15 18:00:15.188-04', NULL);
INSERT INTO public.product VALUES ('prod_01JXRMYV1615B0NVKGBW721BH9', 'Medusa Sweatshirt', 'sweatshirt', NULL, 'Reimagine the feeling of a classic sweatshirt. With our cotton sweatshirt, everyday essentials no longer have to be ordinary.', false, 'published', 'https://medusa-public-images.s3.eu-west-1.amazonaws.com/sweatshirt-vintage-front.png', '400', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-14 21:58:39.929-04', '2025-06-15 18:00:26.663-04', '2025-06-15 18:00:26.663-04', NULL);
INSERT INTO public.product VALUES ('prod_01JXT61QTP32SQ7Z40ZJ472GRA', 'Tokay Gecko Morphs', 'tokay-gecko-morphs', 'Albino', 'Tokay Gecko Morphs introduce exciting variations to this typically vibrant and vocal species, with examples like the striking Albino morph showcasing unique color mutations. These specialized morphs offer collectors a chance to own a distinctive and visually captivating Tokay Gecko beyond its common patterns.', false, 'published', 'http://localhost:9000/static/1750004194421-rescue-gecko-morph-v0-w2rq3kuz397d1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXDC61Z3VEKERK9XR8DRRZG', true, NULL, '2025-06-15 12:16:35.194-04', '2025-06-16 18:29:13.26-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTA68Q89QTC58R5D4QEFB66', 'Black Palm Cockatoo', 'black-palm-cockatoo', 'Goliath Cockatoo', 'The Black Palm Cockatoo, also known as the Goliath Cockatoo, is an exceptionally large and striking parrot, instantly recognizable by its impressive size, prominent crest, and distinctive red facial patches that change color with excitement. These intelligent and long-lived birds are a highly sought-after and rewarding companion for experienced avian enthusiasts.', false, 'published', 'http://localhost:9000/static/1750008537655-dltl4ql5da421.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 13:28:57.865-04', '2025-06-15 13:28:57.865-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTAEEV6NNTWPHMX31DB24CA', 'Toco Toucan', 'toco-toucan', '', 'The Toco Toucan is the most recognizable and largest species of toucan, instantly distinguished by its strikingly oversized, vibrant orange and black bill. These intelligent and playful birds are a captivating and lively addition to a spacious aviary, known for their social nature and unique vocalizations.', false, 'published', 'http://localhost:9000/static/1750008806083-b4vt7c2dfxq21.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 13:33:26.281-04', '2025-06-15 13:33:26.281-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTANMB2GMSFNCQ2KTX2K67P', 'African Grey Parrot', 'african-grey-parrot', '', 'The African Grey Parrot is celebrated worldwide for its exceptional intelligence and remarkable ability to mimic human speech. These highly social birds are known for their strong bonds with owners and require significant mental stimulation, making them a rewarding, long-term companion for dedicated parrot enthusiasts.', false, 'published', 'http://localhost:9000/static/1750009040942-0zlV9uYnpqCkH0VdqW-YdGEv5upX3gVyv5pAwK748tU.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 13:37:21.334-04', '2025-06-15 13:37:21.335-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTATQ177Q3JHKAFGMB1CH9B', 'Golden Conure', 'golden-conure', 'Queen of Bavaria Conure', '', false, 'published', 'http://localhost:9000/static/1750009207746-queen-of-bavaria-golden-conure-parrot-v0-e3cf0rmncux91.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 13:40:07.856-04', '2025-06-15 13:40:07.856-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTBBD2ZHJZTPVYHEJAXV095', 'Major Mitchell''s Cockatoo', 'major-mitchells-cockatoo', 'Leadbeater''s Cockatoo', 'The Major Mitchell''s Cockatoo, also known as Leadbeater''s Cockatoo, is an exquisitely beautiful and highly prized parrot, distinguished by its soft pink and white plumage and a magnificent crest featuring bands of red, yellow, and white. These intelligent and sensitive birds are known for their strong bonds and require dedicated care, making them a truly special companion for experienced avian enthusiasts.', false, 'published', 'http://localhost:9000/static/1750009754649-major-mitchell-leadbeater-cockatoo-v0-f6ojbkxbnjyd1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 13:49:14.728-04', '2025-06-15 13:49:14.728-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTBKRD0035JX4A6AYRS9A1S', 'Sulphur-Crested Cockatoo', 'sulphur-crested-cockatoo', '', 'The Sulphur-Crested Cockatoo is a large, iconic white parrot, instantly recognized by its striking, forward-curving yellow crest. Known for their intelligence, playful antics, and impressive vocalizations, these highly social birds can be incredibly affectionate companions, requiring significant interaction and mental stimulation.', false, 'published', 'http://localhost:9000/static/1750010028106-sulphur-crested-cockatoo-v0-bkgtqr9xy8jd1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 13:53:48.51-04', '2025-06-15 13:53:48.51-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTBST71K9VEAJ7XKWZCY4Y5', 'Blue and Gold Macaw', 'blue-and-gold-macaw', '', 'The Blue and Gold Macaw is a highly popular and instantly recognizable parrot, celebrated for its striking iridescent blue upperparts and vibrant golden-yellow underparts. These intelligent, social, and often playful birds are known for their strong bonds and impressive vocalizations, making them a captivating and long-lived companion for dedicated bird owners.', false, 'published', 'http://localhost:9000/static/1750010226809-blue-and-gold-macaw-v0-jyfqh6yeulvd1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 13:57:06.933-04', '2025-06-15 13:57:06.933-04', NULL, NULL);
