INSERT INTO public.product VALUES ('prod_01JXTCRS24KSYJZMNGJS9E2D29', 'Yellow-Naped Amazon Parrot', 'yellow-naped-amazon-parrot', '', 'The Yellow-Naped Amazon Parrot is a highly intelligent and popular parrot species, easily recognized by the vibrant yellow patch on the back of its neck. Renowned for their exceptional talking ability and playful personalities, these social birds form strong bonds with their owners and require consistent engagement.', false, 'published', 'http://localhost:9000/static/1750011241365-double-yellow-headed-amazon-parrot-v0-9neyj0rco5yd1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 14:14:01.579-04', '2025-06-15 14:14:01.579-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTD0WSD82TQYW0C5YY2CMBA', 'Military Macaw:', 'military-macaw', '', 'The Military Macaw is a striking parrot known for its vibrant green plumage, blue and red facial markings, and powerful bill. These intelligent and social birds are highly communicative and can form strong bonds, making them a charismatic and engaging companion for experienced bird enthusiasts.', false, 'published', 'http://localhost:9000/static/1750011507260-military-macaw-v0-a7f1lovn8k3e1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 14:18:27.519-04', '2025-06-15 14:18:27.519-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTD91EAGY2HZPV0A1TT29XQ', 'Double Yellow-Headed Amazon Parrot', 'double-yellow-headed-amazon-parrot', '', 'The Double Yellow-Headed Amazon Parrot is highly celebrated for its extensive vocabulary and remarkable ability to mimic human speech. These intelligent and charismatic birds are easily recognized by their entirely yellow heads and vibrant green plumage, making them a popular and engaging companion for those seeking a highly vocal and interactive pet.', false, 'published', 'http://localhost:9000/static/1750011774176-double-yellow-headed-amazon-v0-8vy75435pkwd1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 14:22:54.462-04', '2025-06-15 14:22:54.462-04', NULL, NULL);
