INSERT INTO public.product VALUES ('prod_01JXTHXVH80P0D3NT25100KQ10', 'T+ Albino Blood Python', 't-albino-blood-python', '', 'The T+ Albino Blood Python is a captivating genetic morph characterized by its reduced black pigmentation and a beautiful palette of reds, oranges, and yellows that are more intense than traditional albinos. This striking combination results in a vibrant and visually appealing snake, highly valued by collectors for its unique coloration.', false, 'published', 'http://localhost:9000/static/1750016650507-t-albino-blood-python-not-my-photo-v0-keoueej4g7bb1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZFQZ282EQYXMB8W62XNETA', true, NULL, '2025-06-15 15:44:10.85-04', '2025-06-17 13:46:56.325-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTHMDQBYB02K7F6E1C84QD5', 'Boelen’s Python', 'boelens-python', '', 'Boelen’s Python is a large and striking species of snake, highly admired for its iridescent black scales that shimmer with blue and purple hues under light, contrasted by clean white markings. Native to New Guinea, these impressive and often elusive pythons are a coveted addition for experienced reptile keepers due to their unique beauty and substantial size.', false, 'published', 'http://localhost:9000/static/1750016340995-5f3u1f401r711.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZFQZ282EQYXMB8W62XNETA', true, NULL, '2025-06-15 15:39:01.861-04', '2025-06-17 13:47:17.798-04', NULL, NULL);
