INSERT INTO public.product VALUES ('prod_01JXTSP5WW9N37N7W60N639JTH', 'Albino Platinum Alligator Gar', 'albino-platinum-alligator-gar', '', 'The Albino Platinum Alligator Gar is a highly distinctive and sought-after freshwater fish, showcasing the impressive size and predatory features of the Alligator Gar combined with a rare, striking albino mutation. This genetic variation results in a beautiful, often translucent white or platinum body with red eyes, making it a spectacular and rare centerpiece for very large aquariums.', false, 'published', 'http://localhost:9000/static/1750024787669-8465e7_45e38835eedc41d3a17108ed49a3bf92_mv2_540x.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 17:59:47.92-04', '2025-06-15 21:33:45.529-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTT5XNK3MM50MVP36GZEJ0B', 'Fresh water polka Dot stingray', 'fresh-water-polka-dot-stingray', 'xingu river ray', 'The Freshwater Polka Dot Stingray, often specifically referring to the Xingu River Ray, is a stunning and highly sought-after freshwater ray. It is characterized by its dramatic black disc body adorned with intricate white or yellow polka dots, making it a captivating and unique centerpiece for large, specialized aquariums.', false, 'published', 'http://localhost:9000/static/1750025303316-dcd1368683b2ec2c55fa6b82656ff632.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 18:08:23.822-04', '2025-06-15 21:35:43.693-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXT5P03BJPBDQKKDS9F1J68T', 'Satanic Leaf-Tailed Gecko', 'satanic-leaf-tailed-gecko', '', 'The Satanic Leaf-Tailed Gecko is a master of disguise, renowned for its incredible camouflage mimicking dead leaves. With its uniquely flattened, leaf-shaped body and irregular contours, this nocturnal gecko is a truly extraordinary and highly sought-after species for experienced reptile enthusiasts.', false, 'published', 'http://localhost:9000/static/1750003810241-4e9i363i6be81.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXDC61Z3VEKERK9XR8DRRZG', true, NULL, '2025-06-15 12:10:10.448-04', '2025-06-16 18:28:44.377-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXM8WZJJ60Y08JB79T4YWGW', 'Neapolitan Mastiff', 'neapolitan-mastiff', NULL, 'Neapolitan Mastiff (Mastino Napoletano)
Care Level: Moderate (wrinkle care + space requirements)
Temperament: Calm, observant, deeply protective, noble
Diet: Large-breed formula with glucosamine/chondroitin
Lifespan: 7–10 years (giant breed longevity)
Weight: 110–150 lbs (50–68 kg) – Females slightly smaller
Distinct Features: Cascading wrinkles, lumbering gait, massive head

What We Love About This Breed:
➤ "Living Roman Statue" – Descended from war dogs of antiquity, unchanged for millennia
➤ Gentle guardian – Uses intimidating presence rather than aggression (rarely bites)
➤ Shadow follower – Stays close to family while surveying surroundings
➤ Unmistakable look – Wrinkles serve as ancient armor against predator attacks

The Neapolitan Mastiff is a force of nature—deliberate, powerful, and profoundly loyal:
✓ Wrinkle maintenance – Daily cleaning with antifungal wipes (especially muzzle folds)
✓ Minimal exercise needs – Short walks suffice (prone to joint stress)
✓ Coat varieties – Blue, black, mahogany, or tawny (always short and dense)

Ancient Warrior Traits:
✓ Bloodhound-like tracking – Surprisingly skilled scent work despite size
✓ Three-step warning system – Growl, stand-off, then physical blocking
✓ Heat sensitive – Requires AC/shade in warm climates

Health Notes:
Prone to cherry eye, hip dysplasia, and entropion. Responsible breeders screen for:

Cardiac function

Thyroid levels

Patellar luxation

Ideal For:
✔ Experienced owners who respect giant breed needs
✔ Homes with space for a low-energy but massive companion
✔ Those wanting an awe-inspiring yet gentle protector

Historical Icon: Mastinos guarded Roman villas and battled lions in arenas. Their wrinkles were bred to channel blood away from eyes during combat. Modern lines preserve this majestic bearing while softening temperament for family life.', false, 'published', 'http://localhost:9000/static/1750119771636-4a9381539f559135ce36bc530dae3d1b.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXEPDQJNHE7CY1A5QZ2R6NY', true, NULL, '2025-06-16 20:22:53.327-04', '2025-06-17 03:10:55.437-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTQYD9NE4QJ54B5HN5V9XCZ', 'Platinum Asian Arowana Scleropages Formosus', 'platinum-asian-arowana-scleropages-formosus', '', 'Overview: The Platinum Asian Arowana is a stunning and rare variant of the Asian Arowana, characterized by its shimmering, metallic silver coloration that captivates all who see it. Revered in Asian cultures for its majestic appearance and believed to bring good luck and prosperity, this fish is a prized addition to any aquarium.

Origin: Native to Southeast Asia, the Platinum Arowana inhabits slow-moving waters of rivers and lakes. This species is a result of selective breeding to enhance its unique platinum coloration.

Feeding: Omnivorous by nature, the Platinum Arowana thrives on a varied diet. Offer a mix of high-quality pellets, frozen foods such as shrimp and bloodworms, and occasional live feed to ensure optimal health and coloration. It’s important to cater to their predatory instincts with suitably sized prey.

Tank Mates: Given its size and dominance, choosing the right tank mates is crucial. Suitable companions include large, peaceful fish that can hold their own without provoking aggression. Avoid overly aggressive species or those small enough to be considered prey.

Aggression: The Platinum Arowana can exhibit territorial behavior, especially towards smaller or similarly shaped fish. A spacious, well-structured aquarium helps minimize aggression, providing hiding spots and ample room for each inhabitant.

Experience Level: Due to its specific care requirements and size, the Platinum Arowana is best suited for intermediate to advanced aquarists. A commitment to maintaining a pristine environment and meeting its dietary needs is essential for its well-being.

Water Parameters:

Temperature: 75°F to 86°F (24°C to 30°C)
pH: 6.5 to 7.5
Hardness: 5 to 15 dGH
A minimum tank size of 250 gallons is recommended to accommodate their potential growth up to 3 feet in length, ensuring they have enough space to swim freely and thrive.', false, 'published', 'http://localhost:9000/static/1750022959997-Platinum-Asian-Arowana-Scleropages-Formosus.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'pcol_01JXYYRR5VH136RWEM8HYXRDP1', 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 17:29:20.532-04', '2025-06-17 09:29:30.332-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTE5X1E01PFENBK5YW09Y2T', 'Scaleless Ball Python', 'scaleless-ball-python', '', 'The Scaleless Ball Python is a truly unique and highly unusual genetic morph, characterized by the almost complete absence of scales on its body. This distinct lack of scales gives it a soft, smooth texture, making it a rare and fascinating addition for collectors seeking an extraordinary and visually different Ball Python.', false, 'published', 'http://localhost:9000/static/1750012720001-9yi569lbl4y11.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZFQZ282EQYXMB8W62XNETA', true, NULL, '2025-06-15 14:38:40.192-04', '2025-06-17 13:43:56.293-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTEE92FMMC1SFY3BCV482GK', 'Pied Ball Python', 'pied-ball-python', '', 'The Pied Ball Python is a highly sought-after and visually striking genetic morph, characterized by its unique pattern of irregular white patches interspersed with normal colored areas. This distinctive "pied" look makes each individual a one-of-a-kind specimen, appealing to collectors who appreciate its artistic and unpredictable beauty.', false, 'published', 'http://localhost:9000/static/1750012994337-my-first-ball-python-v0-bp9vihefb7ke1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZFQZ282EQYXMB8W62XNETA', true, NULL, '2025-06-15 14:43:14.672-04', '2025-06-17 13:44:20.679-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTEZVZ2W1934Y9EZNW6QS6C', 'Banana Clown Ball Python', 'banana-clown-ball-python', '', 'The Banana Clown Ball Python is a highly prized and visually stunning genetic morph, combining the vibrant, speckled yellow and brown hues of the Banana trait with the clean, reduced pattern of the Clown gene. This unique combination results in a beautiful, often orange-tinged snake with striking dorsal stripes and head patterns, making it a favorite among collectors.', false, 'published', 'http://localhost:9000/static/1750013570861-i-got-a-great-response-asking-peoples-favourite-morphs-now-v0-zk5lwifrfawa1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZFQZ282EQYXMB8W62XNETA', true, NULL, '2025-06-15 14:52:51.083-04', '2025-06-17 13:46:16.875-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTV9HHXWPRTHC5G4FA4ZBVJ', 'Flowerhorn  Cichlid', 'flowerhorn-cichlid', 'premium grade', 'The Flowerhorn Cichlid (Premium Grade) is a highly prized and distinctive freshwater fish, celebrated for its vibrant coloration, unique nuchal hump (kok), and engaging personality. These energetic and intelligent cichlids are known for forming strong bonds with their owners and are often sought after for their exceptional patterns and overall aesthetic appeal.', false, 'published', 'http://localhost:9000/static/1750026470738-1_c795277c-ce59-42f0-a197-4e46ae04853c.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 18:27:51.015-04', '2025-06-15 21:36:29.482-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTZ949VNEHGT822QKVPSVKY', 'Koi Carp', 'koi-carp', 'Japanese Koi', 'Koi fish are a very popular species of carp that have been bred and kept as ornamental fish for hundreds of years. The koi keeping hobby dates back as far as 200BC when the Magoi carp (meaning ‘common carp’) was brought to Japan from China. The Magoi carp was originally bred as a food source, but people quickly started keeping them as pets once skin colour mutations began appearing naturally. It wasn’t until the late 19th century and early 20th century, however, that koi keeping became a popular hobby. Until then, only the richest aristocrats and royalty kept the Magoi carp as ornamental pets rather than eating them. 

The koi keeping hobby as we know it started with the Asagi koi which was first recognised as an ornamental carp around 160 years ago. This koi was often kept by the carp farmers due to its interesting patterns and prompted the popularity of the hobby which led to all sorts of people keeping carp fish, not just the upper class. Shortly after the Asagi had become popular, other mutations in the carp began popping up and farmers began to keep more and more different carp fish. 

Of course, at this point, the farmers decided to give these fish a different name to differentiate the pet Magoi carp from the Magoi carp for eating. Thus, the ornamental carp were named ‘Nishikigoi’ which literally translates as ‘swimming jewel’ and basically means beautiful fish. Over time, with more and more people joining the hobby, the word was shortened to ‘koi’ which is the commonly used word nowadays.', false, 'published', 'http://localhost:9000/static/1750030649031-Assorted-Grade-A-Koi.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 19:37:31.726-04', '2025-06-15 21:38:15.176-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXV0ET0YP4RA5SXCE3TRTZE9', 'Altum Angelfish', 'altum-angelfish', 'Orinoco strain', 'Assorted Angelfish Pterophyllum Scalare 

Care Level: Intermediate
Tank Size: 29 Gal (130 Ltr) min
Temperament: Semi Aggressive
Diet: Carnivore
PH: 6 – 8
Temperature: 25-30°C (78-86°F)
GH: 5-15 DGH (89.24-267.72 ppm)
KH: 8 -12 dkh (143.09-214.64 ppm)
Flow: Slow – Moderate
What We Like About This Fish:

Very elegant appearance and behaviour
Many beautiful colour varieties
Possible to breed in the aquarium
Excellent centrepiece fish for the heavily planted aquarium
The Angelfish is a true centrepiece fish for any aquarium!

The Angelfish (Pterophyllum scalare) is a longtime favourite of aquarists. This shoaling cichlid is relatively peaceful compared to other members of its family. It also has a very thin, tall body unlike most other cichlids. The Angelfish is indigenous to several river systems in Northern South America, but virtually all specimens in the aquarium hobby have been tank-raised for generations. This cultivation and selective breeding has resulted in an array of various attractive colour morphs.

The Angelfish will thrive in a heavily planted aquarium with driftwood and/or rock formations and gentle water flow. It is not overly reclusive, but this fish strongly prefers the cover of plants and, due to its body shape, is not likely to seek refuge in rock caves and similar structures. The Angelfish is generally compatible with other peaceful fish as long as it has plenty of space. Territoriality is typically at its peak during spawning.  Dwarf shrimp and other small, delicate invertebrates should not be kept with the Angelfish, but more durable, larger shrimp and snails could possibly make good tankmates in a large enough aquarium. If spawning is desired, tankmates of other species should be kept to a minimum or avoided altogether unless the aquarium is very spacious.

Feeding is simple for the unfussy Angelfish. High-quality dry, frozen, and live foods will all be readily accepted. Quality and variety are the keys to a diet that will ensure that this fish maintains optimal health and coloration.', false, 'published', 'http://localhost:9000/static/1750031885559-Assorted-Angelfish.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 19:58:06.536-04', '2025-06-15 21:38:54.131-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXV0YSXBC7P5NX8KFC0VRA4D', 'Peacock Bass', 'peacock-bass', '', 'Care Level: Intermediate
Tank Size: 100 Gal (450 Ltr) min
Temperament: Semi – Aggressive
PH: 6.5 – 7.5
Temperature: 22-28°C (76-82°F)
Flow: Slow – Moderate
What We Like About This Fish:

Great Value 
Perfect addition to any predator aquarium
Impressive, but manageable size
Active and feeding time is awesome
With their distinctive coloration Peacock Bass are among the most popular of the large predatory cichlids in the aquarium hobby. These fish are extremely beautiful and lively. The Peacock Bass requires very large aquariums and should only be kept by experienced hobbyists. This species, like all of its close relatives, are powerful predators and will eat any fish that they can fit in their large mouths. They are best kept in small groups with similarly sized cichlids although aggression and territoriality can become an issue as they reach maturity.

 

Diet: The Peacock Bass is a Predator and live fish eater, so feeder fish will be required. They will also typically accept frozen foods and pellets once trained.', false, 'published', 'http://localhost:9000/static/1750032410285-Assorted-Bass.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 20:06:50.617-04', '2025-06-15 21:39:29.002-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXMY2WNWW3R5CPAY2556VF1', 'Azawakh', 'azawakh', NULL, 'Care Level: Moderate (exercise + climate sensitivity)
Temperament: Aloof, fiercely loyal, intensely athletic, cat-like independence
Diet: High-protein performance formula (lean metabolism)
Lifespan: 12–15 years
Weight: 33–55 lbs (15–25 kg)
Distinct Features: Sculpted musculature, ultra-lean frame, sand-colored coat

What We Love About This Breed:
➤ "Desert Wind Incarnate" – Ancient sighthound of the Tuareg nomads
➤ Elegant intensity – Combines ballet dancer’s grace with cheetah-like speed
➤ Selective devotion – Bonds intensely with one person (reserved with strangers)
➤ Minimalist beauty – Short coat showcases rippling muscles in motion

The Azawakh is a desert mirage given form—elusive, elegant, and enduring:
✓ Self-cleaning coat – Weekly rubber grooming mitt sessions suffice
✓ Built for extremes – Thrives in hot climates (needs coats below 50°F/10°C)
✓ Rare colors – Fawn, brindle, blue, or grizzle with white markings

Nomadic Heritage Traits:
✓ 3-stage alert system – Watchful silence → eerie howl → lightning interception
✓ Vertical leap – Can clear 6ft fences from standing position
✓ Cultural reverence – Tuareg tribes consider them family members, not pets

Health Notes:
Exceptionally hardy but prone to exercise-induced collapse and autoimmune issues. Elite breeders test for:

Cardiac function

Thyroid levels

DNA for NCL (neuronal ceroid lipofuscinosis)

Ideal For:
✔ Sighthound enthusiasts who respect independence
✔ Active homes with secure running space
✔ Those seeking a living sculpture with a warrior’s soul

Sacred Guardians: Azawakhs sleep in nomad tents as living alarms. Their name means "land of the free" in Tamacheq, reflecting Tuareg values. Western breeders preserve their desert purity through careful outcrossing programs.', false, 'published', 'http://localhost:9000/static/1750120467075-31762e9b69076c651f1c5a4f32976009.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXEPDQJNHE7CY1A5QZ2R6NY', true, NULL, '2025-06-16 20:34:27.418-04', '2025-06-17 03:08:04.593-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXV29R8C64NYNY71KQVBQHTJ', 'Chana Barc', 'chana-barc', 'Rare snakehead', 'The Chana Barca is an exceptionally rare and highly sought-after species of snakehead fish, prized by collectors for its stunning coloration, intricate patterns, and impressive size. These predatory fish are known for their striking appearance and intelligent behavior, making them a unique and exotic centerpiece for dedicated aquarists.', false, 'published', 'http://localhost:9000/static/1750033817684-0cfa34abd9ca0be2e04fabe6e04fffee.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 20:30:17.875-04', '2025-06-15 20:31:37.212-04', '2025-06-15 20:31:37.21-04', NULL);
INSERT INTO public.product VALUES ('prod_01JXV1TSKZ1RYCD45JGR67T46T', 'Redtail Catfish x Tiger shovelnose Hybrid', 'redtail-catfish-x-tiger-shovelnose-hybrid', '', 'Also known as the Red-Tailed Leopard Tiger Shovelnose Catfish. This is a hybrid Catfish that grows to a large size and is thought to naturally occur in the wild in rivers in South America. It is a cross between a regular Tiger Shovelnose and a Red-Tailed Catfish. This fairly new species is becoming popular with many collectors, hobbyists and zoos everywhere. It has only recently been made available to the aquarium industry and farms like ours are now able to offer these awesome hybrids more readily as the population of successful fry is raised.', false, 'published', 'http://localhost:9000/static/1750033327287-db52e8_77ca2233e64349e4817e609bf300e044_mv2_540x.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 20:22:07.878-04', '2025-06-15 21:40:17.416-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXV297E083HQMDJ5ST46V585', 'Chana Barca', 'chana-barca', 'Rare snakehead', 'The Chana Barca is an exceptionally rare and highly sought-after species of snakehead fish, prized by collectors for its stunning coloration, intricate patterns, and impressive size. These predatory fish are known for their striking appearance and intelligent behavior, making them a unique and exotic centerpiece for dedicated aquarists.', false, 'published', 'http://localhost:9000/static/1750033800310-0cfa34abd9ca0be2e04fabe6e04fffee.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 20:30:01.425-04', '2025-06-15 21:40:41.12-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXV36VVRWKRNHHE75D614EN9', 'Panda Uaru', 'panda-uaru', '', 'The Panda Uaru is known only from the Rio Atabapo (part of the Rio Orinoco drainage) which forms the international boundary between Venezuela and Colombia for much of its length. The water is warm, and very soft and acidic, and these conditions must be recreated in the home aquarium in order for this delicate species to thrive. In the wild, these majestic fish prefer the safety of shady areas amongst vegetation and fallen trees, so this should be replicated in the home aquarium as best as possible. The tank must be biologically mature, at least 48" long, and should incorporate dark substrate and dÃ©cor. Lighting should be dim. The aquarium should be aquascaped with plenty of bogwood and robust plants such as Microsorum pteropus, or plastic/silk varieties. Panda Uaru very much enjoy eating fine-leaved or soft-leaved plants; indeed their faces will almost appear to "˜light up"™ if you present them with some Cabomba caroliniana from time to time, a particular favourite! Panda Uaru are peaceful fish and can be kept alongside other medium-large sized peaceable species. They should not be housed with aggressive or boisterous fish. The only time they are likely to become confrontational is if two of the fish pair off, at which time they should be separated from the rest of the group. Panda Uaru are very susceptible to poor water conditions, so good filtration and frequent partial water changes are a must. Young specimens show a "˜spotted"™ pattern and undergo a dramatic transformation into their adult form. Not recommended for beginners.

Overview
Synonyms	None
Distribution	Venezuela
Maximum Size	24cm (9.5")
Temperature	27-30°C
Water Parameters	Soft and acidic. pH: 4.5-6.2, dH: up to 12 degrees.
Compatibility	Community with no small fish
Lighting	Dim
Sexual Dimorphism	Unable to determine from external features.
Feeding	Flake, granules, cichlid pellets and frozen foods.', false, 'published', 'http://localhost:9000/static/1750034771427-Panda_uaruMAQ1.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 20:46:11.912-04', '2025-06-15 21:41:20.149-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXV4Q69ZKCG4RBBDG63ZAM5P', 'FreshWater Stingray Hybrids', 'freshwater-stingray-hybrids', '', '', false, 'published', 'http://localhost:9000/static/1750036355146-20220813_164356_540x.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 21:12:35.465-04', '2025-06-15 21:41:44.924-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXV522KKJK3NET310DCARK6C', 'Vampire Tetra', 'vampire-tetra', 'Payara', 'The Vampire Tetra is a remarkable characin, but it is not your typical tetra. One look at the mouth of this fish and there will be no doubt that the Payara is a vicious carnivore. This incredible fish has two large fangs on its lower jaw. These fangs can be 4 to 6 inches long. In fact, the two main lower teeth are so long that upper jaw has holes for them to fit into. Payara are fast and aggressive feeders. These fish usually swallow their prey whole but will sometimes chop them into smaller, bite-sized pieces. They get large, too, so if you want to keep one as a pet, be prepared to have a very high feeder-fish bill. This fish can reach up to about 4 feet (117 cm) in length and weigh up to 40 lbs (18 kg), though aquarium specimens are usually only reach a quarter of that size, around 12 inches.', false, 'published', 'http://localhost:9000/static/1750036712020-db52e8_67ec338790bd443786ef774706560e4d_mv2_d_3024_2410_s_4_2_540x.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 21:18:32.084-04', '2025-06-15 21:42:26.129-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXN9TJJKQDNPKRJ5DAEAFE2', 'Irish Wolfhound', 'irish-wolfhound', NULL, 'Care Level: Moderate to High (space + health considerations)
Temperament: Gentle giant, dignified, patient, quietly affectionate
Diet: Premium large-breed puppy/grown formula (joint support critical)
Lifespan: 6–10 years (giant breed longevity)
Weight: 105–180 lbs (48–82 kg) – Females slightly smaller
Distinct Features: Wiry coat, towering height, soulful eyes, effortless grace

What We Love About This Breed:
➤ "Celtic War Hound Reborn" – Ancient breed revived in the 19th century to hunt wolves
➤ Quiet majesty – Combines massive size with serene temperament
➤ Universal goodwill – Friendly to all yet instinctively protective
➤ Noble heart – Known for tender patience with children despite warrior heritage

The Irish Wolfhound is a living legend—towering yet gentle, powerful yet kind:
✓ Low-maintenance coat – Hand-stripping preferred (minimal shedding)
✓ Surprising agility – Moves with deer-like lightness despite size
✓ Color spectrum – Gray, brindle, red, black, or pure white

Ancient Guardian Traits:
✓ Sight-hunting legacy – Can still course with breathtaking speed
✓ Threefold purpose – Historically hunted wolves, guarded castles, and warmed beds
✓ Cold-weather resilience – Double coat provides insulation

Health Notes:
Prone to cardiac issues, bone cancer, and bloat. Reputable breeders provide:

Cardiac echocardiograms

OFA hip certifications

Lifetime breeder support

Ideal For:
✔ Homes with space for a colossal but calm companion
✔ Those seeking a low-energy yet impressive presence
✔ Owners committed to giant breed healthcare

Poetic Legacy: Celebrated in Irish lore as "gentle when stroked, fierce when provoked." The breed’s revival by Captain Graham preserved their iconic silhouette while softening their temperament for modern life.', false, 'published', 'http://localhost:9000/static/1750120851794-d40b2c472077bdfd44ac59f00f1c2b51.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXEPDQJNHE7CY1A5QZ2R6NY', true, NULL, '2025-06-16 20:40:52.129-04', '2025-06-17 03:04:43.991-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXWA7KKSYZQQH3K5S4BTPMMQ', 'Ashera', 'ashera', '', 'Care Level: Very High (expert-only, controversial breed)
Temperament: Variable (depends on generation), intelligent, active
Diet: Raw meat diet required (mimics wild carnivore needs)
Lifespan: ~15 years (limited data due to rarity)
Weight: 20–30 lbs (9–13.6 kg) – Reportedly the largest domestic cat
Distinct Features: Leopard-like spots, long legs, oversized paws

What Makes This Breed Unique (and Controversial):
➤ Hybrid origins – Marketed as a mix of African serval, Asian leopard cat, and domestic cat)
➤ Exclusive pricing – Sold for $20,000–$125,000 as "the world''s rarest cat"
➤ Potential wild traits – Early generations (F1/F2) may show strong hunting instincts, territorial marking
➤ Striking appearance – Taller than a Savannah cat with bold rosettes

Critical Considerations:

❗ High-maintenance needs – Requires:

Outdoor enclosures (catios) – Cannot be fully indoor

Specialized vet care – Few veterinarians handle exotic hybrids

Lifelong training – Early socialization is critical

Health & Behavior Notes:
F1–F3 generations (closer to wild cats) may:

Spray urine to mark territory

Be aloof or aggressive with strangers

Require raw meat diets (whole prey recommended)

Prone to:

Hybrid sterility (males are often infertile)

Digestive issues may occur if fed commercial cat food

Ideal For: Wealthy, experienced exotic cat owners with proper space.', false, 'published', 'http://localhost:9000/static/1750075689971-bac4b133915a122c76956417739a1050.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'pcol_01JXYYRR5VH136RWEM8HYXRDP1', 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 08:08:10.733-04', '2025-06-17 08:47:24.052-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTTNRC5SHN6ED09N3RBV5CA', 'Zebra Shovelnose Catfish', 'zebra-shovelnose-catfish', '', 'Overview: The Merodontatus Tigrinus, commonly known as the Zebra Shovelnose Catfish, is a striking freshwater species prized for its distinctive zebra-like markings and sleek, elongated body. With its unique appearance and active nature, it captivates aquarists seeking an eye-catching addition to their tanks.

Origin: Originating from South America, particularly the Amazon and Orinoco river basins, these catfish inhabit fast-flowing, oxygen-rich waters. They are accustomed to diverse habitats, ranging from riverbeds to flooded forest areas.

Feeding: Primarily carnivorous, the Zebra Shovelnose Catfish thrives on a diet of live or frozen foods like bloodworms, shrimp, and small fish. Providing a varied diet ensures their optimal health and vibrant coloration.

Tank Mates: Best housed with similarly sized, non-aggressive tank mates such as large tetras, barbs, or peaceful cichlids. Avoid keeping them with smaller fish that could be seen as prey due to their predatory instincts.

Aggression: While generally peaceful, juveniles may display territorial behavior as they mature. Provide ample space and hiding spots to reduce potential conflicts among tank mates.

Experience Level: Intermediate to advanced aquarists are recommended due to their specific dietary needs, potential territoriality, and the requirement for a spacious tank setup.

Water Parameters: Maintain a well-filtered aquarium with stable water parameters: temperature between 75-82°F (24-28°C), pH ranging from 6.5 to 7.5, and moderately hard water.', false, 'published', 'http://localhost:9000/static/1750025822466-c3cf26b09db7b7f7ad2761c31665a9dc.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 18:17:02.622-04', '2025-06-15 21:36:08.517-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTWP3J557XVY8BMN8WV2ZG4', 'Discus', 'discus', '', 'Overview: The Golden Discus, known for its brilliant hues and distinctive disc-shaped body, is a true jewel in the aquarium world. With shades ranging from warm gold to vibrant orange, these fish captivate enthusiasts with their beauty and graceful movements.

Origin: Hailing from the Amazon River basin in South America, the Golden Discus thrives in soft, acidic waters. Our carefully curated specimens are raised with utmost care to ensure they retain their natural vitality and coloring.

Feeding: Indulge your Golden Discus with a diet befitting its royal status. These omnivores relish a combination of high-quality pellets, live or frozen foods such as bloodworms and brine shrimp, ensuring they receive a balanced and nutritious meal.

Tank Mates: Create a harmonious aquatic symphony by pairing Golden Discus with peaceful companions like tetras, dwarf cichlids, and angelfish. Avoid aggressive or overly territorial species to maintain the serene ambiance of their shared habitat.

Aggression: While Golden Discus are generally peaceful, they may exhibit territorial behavior during breeding. Adequate hiding spots and a well-planned aquarium layout can help diffuse potential conflicts and provide a stress-free environment.

Experience Level: Ideal for intermediate to advanced aquarists, the Golden Discus requires a nuanced approach to water parameters and care. With a commitment to maintaining stable conditions and regular monitoring, enthusiasts will be rewarded with the splendor of these captivating fish.

Water Parameters: To emulate their native Amazonian habitat, keep water temperatures between 82-86°F (28-30°C), maintain a slightly acidic to neutral pH (6.0-7.0), and ensure soft water conditions. Diligent water changes and a well-established filtration system contribute to their well-being.', false, 'published', 'http://localhost:9000/static/1750027930836-Golden-Discus-Main.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 18:52:11.312-04', '2025-06-15 21:37:13.169-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXV1BH4A5GSHKFYYD01R31W3', 'Datnoid', 'datnoid', 'Asian Tiger Fish', 'Overview: The Asian Perch Datnoid Tiger Fish, scientifically known as Nandus Oxyrhynchus, is a stunning freshwater species revered for its vibrant markings and impressive size. Originating from Southeast Asia, these carnivorous fish exhibit striking patterns resembling a tiger, making them a captivating addition to advanced freshwater aquariums.

Origin: Native to the freshwater habitats of Southeast Asia, particularly found in rivers and streams, the Asian Perch Datnoid Tiger Fish thrives in warm, well-oxygenated waters.

Feeding: As carnivorous predators, these fish prefer live or frozen meaty foods such as small fish, shrimp, and insects. Providing a varied diet ensures their optimal health and coloration.

Tank Mates: Best suited for large, species-specific setups due to their territorial nature. Compatible tank mates include similarly sized, robust fish that can withstand their occasional aggression. However, careful selection and monitoring are crucial to prevent conflicts.

Aggression: Known for their territorial behavior, Asian Perch Datnoids can display aggression, especially when establishing dominance or defending their space. Adequate space and hiding spots help minimize conflicts.

Experience Level: Recommended for experienced aquarists due to their specific care requirements, territorial behavior, and need for larger tank setups. Novice aquarists might find their care needs challenging.

Water Parameters: Maintaining stable water conditions is imperative. Aim for a pH between 6.5 to 7.5, water temperature around 75-82°F (24-28°C), and moderate hardness.', false, 'published', 'http://localhost:9000/static/1750032827330-Silver-Tiger-Datnoid-Tiger-Fish-Datnioides-Polota.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5QD1DSPC4Q9NSJ0XKA3N4', true, NULL, '2025-06-15 20:13:47.576-04', '2025-06-15 21:39:56.668-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXT4DXZR7J0DG2AEMZC5SAWV', 'High-End Crested Gecko Morph', 'high-end-crested-gecko-morph', '', 'High-End Crested Gecko Morphs represent the pinnacle of captive breeding, showcasing exceptional and rare color patterns, traits, and structural characteristics. These highly sought-after geckos often feature vibrant hues, intricate markings, and unique genetic combinations, making them prized possessions for collectors and enthusiasts looking for truly striking and distinctive individuals.', false, 'published', 'http://localhost:9000/static/1750002497156-what-morph-is-this-crested-gecko-v0-9ylgvkn1om4f1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXDC61Z3VEKERK9XR8DRRZG', true, NULL, '2025-06-15 11:48:17.551-04', '2025-06-16 18:25:32.922-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXT51WX43M2HPQY6GE6QK51H', 'Chahoua Gecko', 'chahoua-gecko', 'Mossy Prehensile-Tailed Gecko', 'The Chahoua Gecko, often called the Mossy Prehensile-Tailed Gecko, is a captivating arboreal species known for its remarkable camouflage. Its unique mossy appearance and prehensile tail make it blend seamlessly into its forest habitat, offering an intriguing and visually distinctive pet for reptile enthusiasts.', false, 'published', 'http://localhost:9000/static/1750003151604-would-a-heat-mat-be-sufficient-temporarily-for-a-prehensile-v0-disjskmlfk4e1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXDC61Z3VEKERK9XR8DRRZG', true, NULL, '2025-06-15 11:59:11.827-04', '2025-06-16 18:27:42.959-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXNK31Q6CNAN2VWTJ58EZM1', 'Alaskan Malamute', 'alaskan-malamute', NULL, 'Care Level: High (exercise + grooming demands)
Temperament: Bold, affectionate, independent, pack-oriented
Diet: High-protein working dog formula (prone to obesity)
Lifespan: 10–14 years
Weight: 75–100 lbs (34–45 kg) – Females slightly smaller
Distinct Features: Wolf-like face, plush tail, powerful build, "snowshoe" paws

What We Love About This Breed:
➤ "Arctic Powerhouse" – Oldest native sled dog of Alaska, bred by the Mahlemut Inuit
➤ Freight-hauling strength – Can pull 1,000+ lbs (450 kg) over short distances
➤ Social pack mentality – Thrives in multi-dog homes (dominance challenges possible)
➤ Winter enthusiast – Loves snow so much they''ll sleep buried in drifts

The Alaskan Malamute is a blizzard given form—strong-willed, enduring, and magnificent:
✓ Blizzard-proof coat – Thick double layer requires daily brushing (blows coat 2x/year)
✓ Working dog physique – Deep chest, muscular shoulders, compact feet
✓ Color variations – Gray/wolf, black/white, sable, or rare red

Arctic Survival Traits:
✓ Self-sufficient mindset – Thinks independently (not eager-to-please)
✓ Vocal communicator – "Woo-woo" howls instead of barking
✓ Digging instinct – Creates cooling pits in summer, snow dens in winter

Health Notes:
Prone to hip dysplasia, polyneuropathy, and chondrodysplasia. Responsible breeders test for:

OFA/PennHIP certifications

DNA for Alaskan Malamute Polyneuropathy (AMPN)

Eye exams for hereditary cataracts

Ideal For:
✔ Active owners who enjoy winter sports (skijoring, sledding)
✔ Experienced dog handlers comfortable with strong-willed breeds
✔ Homes with secure fencing (notorious escape artists)

Heritage Insight: Unlike faster sled dogs, Malamutes were bred for strength and endurance to haul heavy loads across frozen terrain. Their name honors the Mahlemut tribe who developed them as essential survival partners.', false, 'published', 'http://localhost:9000/static/1750121259147-d02409d105ecabf09860a5c200189c6d.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXEPDQJNHE7CY1A5QZ2R6NY', true, NULL, '2025-06-16 20:45:55.718-04', '2025-06-17 03:02:25.634-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXV90WW6PF25HT5D8TAGCTKM', 'Sphynx', 'sphynx', NULL, 'Care Level: High (requires regular grooming & attention)
Temperament: Affectionate, energetic, social
Diet: High-protein, balanced diet (kibble/wet food)
Lifespan: 8–14 years
Weight: 6–12 lbs (2.7–5.4 kg)
Hypoallergenic: No (despite being hairless, they still produce dander)

What We Love About This Breed:
Playful, dog-like personality—loves attention!

Warm, soft skin with a suede-like texture

Highly intelligent and trainable (can learn tricks)

Excellent companion for those who want an interactive pet

The Sphynx cat is one of the most unique and affectionate feline breeds, known for its striking hairless appearance and outgoing nature.

Contrary to popular belief, the Sphynx is not completely maintenance-free—their lack of fur means they require weekly baths to remove oil buildup, along with regular ear cleaning and nail trims. They also get cold easily and often seek warm spots or even snuggle under blankets.

These cats are extremely social, often following their owners around and demanding lap time. They get along well with other pets and even enjoy meeting new people. Due to their high metabolism, they need a nutrient-rich diet to maintain energy levels.

Despite their alien-like look, Sphynx cats are full of charm—expressive eyes, large ears, and wrinkled skin give them a distinctive appearance. Their playful, mischievous antics make them endlessly entertaining!

Ideal for: Owners who want a loyal, attention-seeking pet and don’t mind extra grooming.', false, 'published', 'http://localhost:9000/static/1750040866606-Sphynx_About_Tetsu.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-15 22:27:48.001-04', '2025-06-15 22:49:06.106-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVAQ1TMGJBZE0X5DC0Y72G4', 'Scottish Fold', 'scottish-fold', NULL, 'Care Level: Moderate
Temperament: Gentle, affectionate, calm
Diet: High-quality dry/wet food (watch for weight gain)
Lifespan: 11–14 years
Weight: 6–13 lbs (2.7–5.9 kg)
Distinct Feature: Folded ears (due to a genetic cartilage mutation)

What We Love About This Breed:
Sweet, owl-like appearance with round eyes and folded ears

Extremely loving and loyal—forms strong bonds with owners

Quiet and adaptable, great for apartments or families

Playful but not overly hyperactive

The Scottish Fold is a charming and unique breed known for its signature folded ears, which give it an adorable, wide-eyed expression. These cats are gentle, easygoing, and thrive on companionship, often following their humans around or curling up in their laps.

Due to their cartilage mutation, Scottish Folds should be bred responsibly (only folded-ear x straight-ear pairings to avoid joint issues). They are generally healthy but can be prone to arthritis later in life, so maintaining a healthy weight is essential.

Their soft, plush coat (in both short and longhair varieties) requires minimal grooming, but they love attention and thrive in interactive environments. Scottish Folds get along well with children, dogs, and other pets, making them excellent family cats.

Ideal for: Those who want a calm, affectionate companion with a distinctive look.', false, 'published', 'http://localhost:9000/static/1750042641897-Scottish-Fold.LH_-scaled.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-15 22:57:22.331-04', '2025-06-15 23:05:59.076-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXWBESRMH3TY0AND8X6Y776F', 'Persian', 'persian', NULL, 'Persian (Felis catus)
Care Level: High (demanding grooming needs)
Temperament: Calm, affectionate, regal
Diet: Special kibble shape (brachycephalic-friendly)
Lifespan: 12–16 years
Weight: 7–12 lbs (3–5.4 kg)
Distinct Features: Ultra-flat face (peke-faced), long luxurious coat, massive round eyes

What We Love About This Breed:
➤ Living plush toy – Iconic fluffy appearance with a sweet demeanor
➤ Quiet royalty – Prefers lounging over mischief (ideal apartment cat)
➤ Over 80 color varieties – From snowy white to "chinchilla silver"
➤ The ultimate lap cat – Will cuddle for hours without fuss

The Persian is the quintessential show cat, with two facial types:

Traditional ("Doll Face") – Less extreme, historical look

Ultra-typed ("Peke Face") – Very flat, requires extra care

Critical Care Requirements:
✧ Daily grooming – 30+ mins to prevent life-threatening mats
✧ Eye wiping – 2–3x/day to prevent tear staining (use vet-approved wipes)
✧ Air-conditioned environment – Heatstroke risk due to short airways


Ideal For: Dedicated owners willing to commit to daily maintenance for a majestic companion.

History Tidbit: First exhibited at the 1871 London Crystal Palace show—Queen Victoria owned two blue Persians!', false, 'published', 'http://localhost:9000/static/1750076974437-aee6ea2a265a433801352d897d34c00c.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 08:29:34.96-04', '2025-06-16 08:30:05.513-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXVGYT8T5WA82F3DFZX7N60', 'Lagotto Romagnolo', 'lagotto-romagnolo', NULL, 'Lagotto Romagnolo
The Truffle-Hunting Charmer

Why Everyone Adores Them:
➤ "The Original Truffle Hound" – Italy’s curly-coated wonder with a nose for treasure
➤ Hypoallergenic Superstar – Non-shedding coat perfect for allergy sufferers
➤ Brain + Beauty – Clever enough to find gourmet fungi, cute enough to melt hearts
➤ Adventure-Ready – Equally happy splashing through marshes or snoozing by the fire

Vital Stats:
✨ Size: 24-35 lbs (11-16 kg) – Compact but sturdy
✨ Lifespan: 15-17 years (remarkably long-lived!)
✨ Coat Care: ★★★☆☆ – Professional grooming every 2-3 months + weekly brushing
✨ Energy Level: ★★★★☆ – Enthusiastic worker, expert snuggler

Secret Superpowers:
✓ Nose of Gold – Can detect truffles 12 inches underground
✓ Waterproof Curls – Built for swampy Italian marshlands
✓ Emotional IQ – Tuned into human moods like a fuzzy therapist

Perfect For:
✔ Active families who love outdoor adventures
✔ First-time dog owners (eager to please + highly trainable)
✔ Foodies who dream of finding their own truffles

Fun Fact:
Their name means "Lake Dog from Romagna" – bred to retrieve waterfowl before becoming truffle specialists!', false, 'published', 'http://localhost:9000/static/1750127377085-01723192d4463bde818e8a06a333771b.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXEPDQJNHE7CY1A5QZ2R6NY', true, NULL, '2025-06-16 22:29:37.231-04', '2025-06-17 01:16:40.555-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVBVW559N8HBEHJPMCAW9VA', 'Maine Coon', 'maine-coon', '', 'Care Level: Moderate (due to size and grooming needs)
Temperament: Gentle, friendly, intelligent
Diet: High-protein, large-breed formula (kibble/wet food)
Lifespan: 12–15 years
Weight: 10–25 lbs (4.5–11.3 kg) – One of the largest domestic cat breeds!
Distinct Features: Tufted ears, bushy tail, water-resistant coat

What We Love About This Breed:
➤ "Gentle giant" personality – sociable but not clingy
➤ Dog-like traits – can learn tricks, some enjoy playing fetch
➤ Magnificent floof – luxurious, shaggy coat with a raccoon-like tail
➤ Adaptable nature – does well with families, singles, and other pets

The Maine Coon is America''s native longhaired superstar, known for its impressive size, tufted ears, and outgoing personality. These cats are highly intelligent, playful well into adulthood, and famously good with children and other animals.

Despite their substantial grooming needs (brush 2–3x weekly to prevent mats), their semi-water-resistant fur is easier to maintain than many longhaired breeds. They''re excellent mousers and retain a kitten-like curiosity throughout their lives.

A unique trait is their chirping trill – a melodic sound between a meow and purr. Many Maine Coons enjoy water (some will dip paws in their bowls or join owners in the shower).

Health Note: Prone to hypertrophic cardiomyopathy (HCM) – reputable breeders screen for this.

Ideal For: Active owners who want a low-drama, interactive companion with majestic presence.', false, 'published', 'http://localhost:9000/static/1750043848502-MainCoon_LarryJohnson-1024x682.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-15 23:17:28.947-04', '2025-06-15 23:17:28.947-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVC6BCFG9JVP1EFVFY191BC', 'Ragdoll', 'ragdoll', '', 'Care Level: Moderate
Temperament: Docile, affectionate, people-oriented
Diet: High-quality dry/wet food (prone to weight gain)
Lifespan: 12–17 years
Weight: 10–20 lbs (4.5–9 kg) – Females smaller than males
Distinct Features: Striking blue eyes, pointed coloration, silky semi-long coat

What We Love About This Breed:
➤ "Puppy-cat" personality – follows owners room-to-room
➤ Famous floppiness – goes limp when held (hence the name!)
➤ Stunning blue eyes – always in mesmerizing sapphire hue
➤ Quiet voice – gentle meows, more likely to communicate with body language

The Ragdoll is the ultimate velcro cat, bred for their calm temperament and tendency to relax completely in human arms. These gentle giants mature slowly, reaching full size around 4 years old, with males often growing significantly larger than females.

Their colorpoint coat (darker face/ears/tail) comes in seal, blue, chocolate, lilac, and flame patterns, with mitted or bicolor variations. While beautiful, their silky fur is low-maintenance compared to other longhairs (brush 2–3x weekly).

Ragdolls thrive on routine and can develop separation anxiety if left alone too often. They’re not street-smart – indoor-only living is a must. Unlike many cats, they typically enjoy belly rubs and being carried like a baby.

Health Notes: Prone to hypertrophic cardiomyopathy (HCM) and bladder stones – reputable breeders screen for these.

Ideal For: Homebodies who want a cuddly, low-energy companion that acts like a living stuffed animal.

Fun Fact: Ragdolls were created in 1960s California by breeding a white Persian-like cat named Josephine with Birman/Siamese-type cats.', false, 'published', 'http://localhost:9000/static/1750044191871-RDportrait.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-15 23:23:12.199-04', '2025-06-15 23:23:12.199-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVCQKKZB7PTNVE6DHHMY8Y0', 'Oriental Shorthair', 'oriental-shorthair', '', 'Care Level: Moderate (needs mental stimulation)
Temperament: Highly social, vocal, energetic
Diet: High-protein diet (fast metabolism)
Lifespan: 12–15 years
Weight: 6–12 lbs (2.7–5.4 kg)
Distinct Features: Wedge-shaped head, large ears, sleek athletic body

What We Love About This Breed:
➤ Extroverted personality – thrives on interaction and conversation
➤ Gymnast-like agility – leaps to high shelves with ease
➤ Over 300 color/pattern combinations – from ebony to lavender
➤ Siamese cousin – all the brains and chatter without pointed restrictions

The Oriental Shorthair is essentially a rainbow-colored Siamese, sharing the same talkative nature and high IQ but with a vastly expanded palette. These cats form intense bonds with their humans and will narrate your entire day in their distinctive raspy voice.

Their short, glossy coat requires minimal grooming (weekly wipe-downs suffice), but their energy demands are substantial. Puzzle feeders, leash walks, and daily play sessions are musts to prevent boredom-induced mischief. Unlike more aloof breeds, Orientals hate being alone – they do best with feline companions or work-from-home owners.

Health Notes: Prone to dental issues (regular teeth brushing recommended) and same genetic conditions as Siamese (amyloidosis, heart defects).

Ideal For: Experienced cat lovers who want a dog-like companion with endless opinions and acrobatic antics.

Did You Know? The breed was developed by crossing Siamese with other shorthairs to create the same elegant body type in solid colors and patterns.', false, 'published', 'http://localhost:9000/static/1750044757352-Oriental-SH.blue-tabby-1024x683.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-15 23:32:37.692-04', '2025-06-15 23:32:37.692-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVD2FE0RR4BWV6MY7S00S8A', 'Russian Blue', 'russian-blue', '', 'Care Level: Moderate (sensitive to routine changes)
Temperament: Reserved with strangers, deeply loyal to family
Diet: High-protein, grain-free (prone to food sensitivities)
Lifespan: 15–20 years
Weight: 7–12 lbs (3–5.4 kg)
Distinct Features: Emerald-green eyes, silver-tipped blue coat, "smiling" expression

What We Love About This Breed:
➤ Plush double coat – sheds minimally despite being dense
➤ Quiet elegance – observes before engaging (unlike vocal Siamese-types)
➤ Hypoallergenic reputation – produces less Fel d 1 protein than most cats
➤ Playful but polite – enjoys fetch but won’t climb your curtains

The Russian Blue is the aristocrat of the cat world, combining striking beauty with a thoughtful, mild-mannered personality. These cats form intense bonds with one or two people, often shadowing their chosen human while maintaining polite distance from guests.

Their dense, silvery-blue coat has a shimmering quality from unique hair structure (each strand has a pale tip). Surprisingly low-maintenance – weekly brushing and occasional baths keep it pristine. Unlike many breeds, Russian Blues are fastidious groomers who rarely develop hairballs.

While not overtly demanding, they thrive on predictable routines and dislike loud noises or chaotic households. Their intelligence shines through puzzle toy mastery and ability to learn tricks (when motivated by treats).

Health Notes: Generally robust, but some lines prone to bladder stones and feline obesity (monitor treat intake).

Ideal For: Quiet households wanting a loyal, low-drama companion with museum-quality beauty.

Historical Tidbit: Believed to have sailed from Arkhangelsk (Russia) with 19th-century sailors, their thick coat evolved for Arctic port winters despite today’s moderate exercise needs.', false, 'published', 'http://localhost:9000/static/1750045113396-RussianBlue_LarryJohnson.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-15 23:38:33.922-04', '2025-06-15 23:38:33.922-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXHS5T1P8X203PCW84AS09D', 'Bulldog', 'french-bulldog', NULL, 'Care Level: Moderate (heat/sensitivity management + skincare)
Temperament: Charming, adaptable, playful, deeply human-focused
Diet: High-quality small-breed formula (allergy/sensitivity prone)
Lifespan: 10–14 years
Weight: 16–28 lbs (7–13 kg)
Distinct Features: Bat ears, smushed face, compact muscular body

What We Love About This Breed:
➤ "Parisian Charmer" – 19th century lace workers'' companion turned global icon
➤ Big personality in small package – Comedic, affectionate, thrives on attention
➤ Adaptable companion – Equally happy in city apartments or country homes
➤ Low exercise needs – Content with short walks + indoor play sessions

The Elite French Bulldog combines health-focused breeding with breed essence:
✓ Open nostrils + longer palate – Responsible breeders prioritize airway health
✓ Compact but athletic – Should move freely without respiratory distress
✓ Coat variations – Fawn, brindle, pied, or rare colors (with health testing)

Premium Traits (Elite Lines):
✓ Stable temperament – Bred for confidence without neuroses
✓ Reduced health risks – Screened for IVDD, hips, and eye conditions
✓ Show/companion balance – Beautiful yet functional structure

Health Notes:
Require climate control (overheats easily), spinal care, and allergy management. Top breeders provide:

Genetic testing for DM, HUU, CMR1

BOAS (breathing) grading

X-rays for IVDD predisposition

Ideal For:
✔ Urban dwellers seeking a portable, low-exercise companion
✔ Families wanting a funny, affectionate shadow
✔ Discerning owners prioritizing health-tested pedigrees

Cultural Icon: The Frenchie''s rise from working-class pet to modern "it dog" reflects its irresistible charm. Elite breeding now focuses on preserving this appeal while advancing health.', false, 'published', 'http://localhost:9000/static/1750117303572-aac788734418f5033dd03d3e8ead7d51.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXEPDQJNHE7CY1A5QZ2R6NY', true, NULL, '2025-06-16 19:39:20.875-04', '2025-06-17 04:37:47.998-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVDMH3GR49490CSV86V7EN3', 'Abyssinian', 'abyssinian', '', 'Care Level: High (needs active engagement)
Temperament: Curious, adventurous, highly intelligent
Diet: High-protein, calorie-dense (fast metabolism)
Lifespan: 12–15 years
Weight: 6–12 lbs (2.7–5.4 kg)
Distinct Features: Tickled coat, large ears, lynx-like appearance

What We Love About This Breed:
➤ "Ticked" agouti coat – each hair has alternating light/dark bands for a wild, shimmering effect
➤ Perpetual motion machine – climbs, explores, and investigates everything
➤ Problem-solving whiz – opens cabinets, learns tricks, masters puzzle toys
➤ People-oriented – more interactive than lap-cuddly (think "cat version of a border collie")

The Abyssinian is one of the oldest known cat breeds, resembling the sacred cats depicted in ancient Egyptian art. These high-octane felines need vertical spaces, interactive toys, and preferably a feline playmate to burn off energy. Unlike more sedentary breeds, Abyssinians remain kitten-like well into seniorhood.

Their short, low-shedding coat (in ruddy, red, blue, and fawn colors) requires minimal grooming but shows every speck of dust – ideal for owners who enjoy showing off pristine pets. While not overly vocal, they communicate through expressive chirps and will "help" with all your activities (including typing on keyboards).

Health Notes: Prone to gingivitis (requires dental care) and renal amyloidosis in some bloodlines.

Ideal For: Active owners who want a brainy, engaging pet that thrives on training and adventure.

Fun Fact: A 2007 genetic study traced the breed''s origins to Indian Ocean coastal regions – likely brought to Europe by colonial traders.', false, 'published', 'http://localhost:9000/static/1750045704796-Aby_blu_Chanan1-1024x797.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-15 23:48:25.448-04', '2025-06-15 23:48:25.448-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVE1ENF2QVH2ZDY13NT25DX', 'American Curl', 'american-curl', '', 'Care Level: Moderate (ear care is essential)
Temperament: Playful, affectionate, people-oriented
Diet: Balanced diet (kibble/wet food) – no special requirements
Lifespan: 12–16 years
Weight: 5–10 lbs (2.3–4.5 kg)
Distinct Features: Unique backward-curling ears, expressive walnut-shaped eyes

What We Love About This Breed:
➤ Signature curled ears – soft, flexible cartilage that curls back 90–180 degrees (kittens are born with straight ears that curl within days)
➤ Adaptable personality – equally happy in apartments or houses
➤ Moderate energy – playful but not hyperactive
➤ Dog-like devotion – follows owners around but isn’t clingy

The American Curl is one of the few cat breeds defined by a natural genetic mutation (first discovered in 1981 in California). Their whimsical ears, which should never be forcibly straightened, require gentle weekly cleaning to prevent wax buildup but are otherwise low-maintenance.

These cats strike a perfect balance between playfulness and calm, enjoying interactive toys but also content to lounge nearby. They’re excellent with children and other pets, making them ideal family cats. While not as vocal as Siamese, they communicate with soft trills and chirps.

Their coat comes in both longhair and shorthair varieties, with the longhair version having a silky, tangle-resistant texture. Regular brushing (1–2x weekly) keeps shedding under control.

Health Notes: Generally healthy, but their unique ear structure can make them more prone to ear infections – regular vet checks recommended.

Ideal For: Families or singles who want a friendly, low-drama companion with a distinctive look.

Did You Know? All American Curls trace their lineage back to Shulamith, the original stray cat with curled ears found in Lakewood, California.', false, 'published', 'http://localhost:9000/static/1750046128408-ac-profile2.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-15 23:55:28.882-04', '2025-06-15 23:55:28.882-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVEDM4MQEXK3CAY08X9X0V9', 'Himalayan', 'himalayan', '', 'Care Level: High (grooming-intensive)
Temperament: Calm, affectionate, gentle
Diet: High-quality dry/wet food (prone to weight gain)
Lifespan: 9–15 years
Weight: 7–12 lbs (3–5.4 kg)
Distinct Features: Flattened face (brachycephalic), deep blue eyes, luxuriant coat

What We Love About This Breed:
➤ Striking "pointed" coloration – dark ears/face/paws (like a Siamese) with a long Persian coat
➤ Ultra-sweet personality – more laidback than traditional Siamese
➤ Lap cat extraordinaire – thrives on cuddles and quiet companionship
➤ Expressive eyes – their sapphire-blue gaze seems almost human

The Himalayan is essentially a colorpoint Persian, combining the best traits of both breeds. Developed in the 1950s by crossing Persians with Siamese, these cats inherit the Persian’s luxurious fur and the Siamese’s striking color pattern—but with a much mellower voice.

Their daily grooming needs are substantial—expect to brush their long, silky coat thoroughly to prevent painful mats. Many owners opt for a "lion cut" during summer months for easier maintenance. Due to their flat faces, they require regular eye cleaning to prevent tear staining and may snore or breathe noisily.

Himmies are indoor-only cats—their coat isn’t weather-resistant, and their docile nature makes them poor candidates for outdoor life. They adore stable routines and may become stressed in chaotic households.

Health Notes: Prone to polycystic kidney disease (PKD), respiratory issues, and dental problems—reputable breeders screen for these.

Ideal For: Homebodies who want a stunning, low-energy companion and don’t mind extensive grooming.

Fun Fact: Despite their name, Himalayans have no connection to the Himalayas—the breed was developed entirely in the U.S. and U.K.', false, 'published', 'http://localhost:9000/static/1750046527169-what-cat-breed-is-my-cat-is-she-himalayan-or-ragdoll-v0-t9hcess7pcrd1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 00:02:07.736-04', '2025-06-16 00:02:07.736-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVERPS93QM3DW26JP9MS74N', 'Burmese', 'burmese', '', 'Care Level: Moderate (social needs are high)
Temperament: Extroverted, affectionate, "Velcro cat" personality
Diet: High-protein diet (prone to obesity if overfed)
Lifespan: 10–16 years
Weight: 8–12 lbs (3.6–5.4 kg) – Surprisingly heavy for their size!
Distinct Features: Muscular build, golden-yellow eyes, satin-like coat

What We Love About This Breed:
➤ "Puppy-cat" charm – follows owners everywhere, even on walks (many enjoy harness training)
➤ Velvety short coat – shines like polished mahogany in sable, champagne, blue, or platinum
➤ Endless chatter – not as loud as Siamese, but equally opinionated with a softer voice
➤ Playful into old age – maintains kitten-like energy well into adulthood

The Burmese is a people-addicted charmer, originally from Southeast Asia but refined in the U.S. Unlike more aloof breeds, these cats demand to be involved in every activity—whether you''re working, cooking, or sleeping (they make excellent weighted blankets!).

Their glossy, low-maintenance coat requires only weekly petting with a chamois cloth to maintain its sheen. However, their emotional needs are intensive—they suffer deeply when left alone for long periods. A second Burmese or vocal breed (like a Siamese) makes an ideal companion.

Modern Burmese divide into two types:

American (stockier, rounder head)

British (more angular, "foreign" body type)

Health Notes: Prone to feline hyperesthesia syndrome (skin-rolling behavior) and cranial deformities in some bloodlines.

Ideal For: Retirees or work-from-home owners who want a shadow-like companion with comedic antics.

Did You Know? The original Burmese, Wong Mau, was brought from Burma to San Francisco in 1930—her DNA revealed she was actually a Siamese/Burmese hybrid!', false, 'published', 'http://localhost:9000/static/1750046890520-Burmese_face_Helmi1.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 00:08:10.848-04', '2025-06-16 00:08:10.848-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVFA9ANFXBA86NMMRJPTF76', 'Toyger', 'toyger', '', 'Care Level: Moderate (needs mental stimulation)
Temperament: Playful, social, intelligent
Diet: High-protein diet (mimicking wild cat nutrition)
Lifespan: 10–15 years
Weight: 7–15 lbs (3–7 kg)
Distinct Features: Striking tiger-like stripes, muscular build, circular markings on head

What We Love About This Breed:
➤ Miniature tiger appearance – bold, branching stripes and rich orange coat
➤ Athletic and agile – loves climbing, jumping, and interactive play
➤ Highly trainable – can learn tricks, walk on a leash, and even play fetch
➤ People-oriented – forms strong bonds but isn’t overly clingy

The Toyger is a designer breed developed to resemble a tiny, domesticated tiger—complete with striking vertical stripes, a confident stride, and an exotic wildcat aura. Created in the 1980s by crossing Bengal cats with striped domestic shorthairs, Toygers are bred for their dramatic markings and friendly, outgoing personalities.

Their short, plush coat is easy to maintain (weekly brushing suffices) and comes in vibrant shades of brown, gold, and orange with high-contrast black or dark brown stripes. Unlike actual wildcats, Toygers have a sweet, dog-like temperament—they thrive on human interaction and enjoy being part of family activities.

These cats need plenty of enrichment—puzzle toys, cat trees, and even outdoor adventures (on a leash or in a secure catio) help satisfy their active minds. They get along well with other pets and older children but may be too energetic for very young kids.

Health Notes: Generally robust, but some lines may be prone to heart murmurs—reputable breeders screen for health issues.

Ideal For: Adventurous owners who want an exotic-looking but friendly feline companion.

Fun Fact: The breed’s name is a blend of "toy" + "tiger"—and the goal is to eventually develop a cat with white belly markings (like real tigers) through selective breeding', false, 'published', 'http://localhost:9000/static/1750047466255-ever-heard-of-a-toyger-v0-b7omo80qat2f1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 00:17:46.976-04', '2025-06-16 00:17:46.976-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVFQKXRDYGREXCG6GWWZHK6', 'Singapura', 'singapura', '', 'Care Level: Low (but demands attention)
Temperament: Curious, affectionate, mischievous
Diet: High-quality small-bite kibble (tiny jaws)
Lifespan: 12–15 years
Weight: 4–8 lbs (1.8–3.6 kg) – World''s smallest cat breed!
Distinct Features: Large ears, almond-shaped eyes, sepia-toned "ticked" coat

What We Love About This Breed:
➤ Pocket-sized dynamo – all the personality of a big cat in a tiny package
➤ "Ticked" coat pattern – each hair alternates light/dark bands like desert sand
➤ Big, expressive eyes – range from hazel to green-gold with permanent eyeliner
➤ Fearless explorer – will investigate every cupboard and handbag

The Singapura is a living paradox: delicate in size but bold in character. Originating from Singapore''s street cats (though controversially developed in the U.S.), these "drain cats" pack enormous energy into their petite frames. Their coat—warm ivory with dark brown ticking—earned them the nickname "Little Lions" in their homeland.

Despite their size, they:
✓ Jump surprisingly high (often perch on shoulders)
✓ Demand lap time (especially under blankets)
✓ Communicate with chirps (not loud meows)

Health Notes: Prone to uterine inertia in queens (C-sections common) and PK deficiency in some lines.

Ideal For: City dwellers wanting a compact, big-hearted companion that thrives in small spaces.

Did You Know? A Singapura named Brady became the official mascot for Singapore Tourism Board in the 1990s!', false, 'published', 'http://localhost:9000/static/1750047902985-Singapura_WC08_942-1024x683.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 00:25:03.827-04', '2025-06-16 00:25:03.827-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVG3VQ6HNY90BZNVYXGP98V', 'LaPerm', 'laperm', '', 'Care Level: Moderate (grooming varies by coat type)
Temperament: Affectionate, playful, people-oriented
Diet: Balanced diet (no special requirements)
Lifespan: 10–15 years
Weight: 6–12 lbs (2.7–5.4 kg)
Distinct Features: Curly or wavy coat, expressive eyes, athletic build

What We Love About This Breed:
➤ Hypoallergenic potential – produces less Fel d 1 protein than most cats
➤ Unique "perm" coat – loose ringlets or marcel waves that feel soft as lamb''s wool
➤ Highly adaptable – thrives in both active households and quiet apartments
➤ Dog-like loyalty – follows owners like a shadow and greets them at the door

The LaPerm is a genetic surprise package—kittens may be born bald, straight-haired, or curly, with their final coat developing over 2–3 years. Unlike other curly-coated breeds (like Selkirk Rex), their curls are lightweight and airy, forming natural "bedhead" waves rather than tight coils.

Coat care is surprisingly easy:

Longhaired: Light combing 2x weekly to prevent tangles

Shorthaired: Occasional hand-stroking to enhance waves

All types: Rarely need baths (curls spring back when dampened)

These cats are excellent climbers with strong hind legs, often perching on high vantage points to oversee household activities. While playful, they balance energy with deep cuddling sessions—especially in cool weather when they''ll burrow under blankets.

Health Notes: Exceptionally healthy breed with no known genetic predispositions.

Ideal For: Allergy sufferers wanting a low-shedding, high-love companion.

Origin Story: The first LaPerm, Curly, was born in 1982 on an Oregon cherry farm to a straight-haired barn cat—her mutation occurred spontaneously', false, 'published', 'http://localhost:9000/static/1750048304779-LaPerm-ABOUT-THE-BREED.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 00:31:44.884-04', '2025-06-16 00:31:44.884-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVGGYY6H6A1ESA1S0HXD99P', 'Manx', 'manx', '', 'Care Level: Moderate (spinal health monitoring)
Temperament: Playful, intelligent, dog-like
Diet: Weight-management formula (prone to obesity)
Lifespan: 8–14 years
Weight: 8–12 lbs (3.6–5.4 kg) – Heavy for their size!
Distinct Features: Tailless or stub-tailed, rounded rump, rabbit-like hind legs

What We Love About This Breed:
➤ Unique silhouette – famous "cabbit" appearance (cat + rabbit)
➤ Powerful jumper – extra-long hind legs launch them to surprising heights
➤ Water fascination – many enjoy playing with faucets or swimming
➤ Legendary mousers – originated as working cats on Isle of Man ships

The Manx is one of the world''s oldest natural breeds, hailing from the Isle of Man where their tailless gene became dominant. Their body type ranges from:

Rumpy (complete taillessness with dimpled rump)

Riser (small cartilage bump)

Stumpy (short tail)

Longy (half-length tail)

Their double coat (short or semi-long) feels dense like a otter''s fur, with seasonal "blowouts" requiring weekly brushing. Despite their cobby build, they''re agile hunters who enjoy fetch and puzzle toys.

Critical Health Notes:
❗ Manx Syndrome (spinal defects) affects ~20% – choose breeders who x-ray breeding stock
❗ Delayed litter training common (spinal issues may cause incontinence)

Ideal For: Active families wanting a clownish, loyal companion – but avoid if unwilling to monitor for neurological symptoms.

Folklore Bonus: Local legend says the Manx lost its tail when Noah closed the ark door too soon.', false, 'published', 'http://localhost:9000/static/1750048733960-Manx_Larry_Johnson1.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 00:38:54.189-04', '2025-06-16 00:38:54.189-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVGVMBPS4017H6B3J91M98E', 'Tonkinese', 'tonkinese', '', 'Care Level: Moderate (needs interaction)
Temperament: Social, vocal, mischievously charming
Diet: High-protein (inherits Siamese metabolism)
Lifespan: 12–16 years
Weight: 6–12 lbs (2.7–5.4 kg)
Distinct Features: Aqua-colored eyes, mink coat, athletic wedge-shaped body

What We Love About This Breed:
➤ Hypnotic "aquamarine" eyes – neither blue like Siamese nor green like Burmese
➤ Velvety "mink" coat – temperature-sensitive coloring with subtle point contrast
➤ Perfect middle ground – less loud than Siamese, more active than Burmese
➤ Professional cuddler – insists on sleeping under covers with you

The Tonkinese is the vivacious lovechild of Siamese x Burmese crosses, combining the best traits of both parents. Their coat comes in three patterns:

Natural Mink (medium contrast with aqua eyes)

Pointed (higher contrast, blue eyes like Siamese)

Solid (low contrast, green-gold eyes like Burmese)

These cats are eternal kittens, maintaining playful energy into old age. They excel at:
✓ Opening cabinets with clever paws
✓ Learning tricks (especially for clicker training)
✓ "Helping" with chores (i.e., batting at laundry)

Health Notes: Prone to gingivitis (needs dental care) and feline asthma in some lines.

Ideal For: Families wanting a people-focused cat that balances Siamese smarts with Burmese sweetness.

History Tidbit: Though resembling ancient Thai temple cats, the breed was formally developed in 1960s Canada as "Golden Siamese.', false, 'published', 'http://localhost:9000/static/1750049083687-Tonkinese-Natural-Color-IMG_1772.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 00:44:43.771-04', '2025-06-16 00:44:43.771-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVH5WA5MM7590KS5NVGS703', 'Norwegian Forest Cat', 'norwegian-forest-cat', '', 'Care Level: Moderate to High (seasonal shedding)
Temperament: Gentle, independent yet affectionate, intelligent
Diet: High-protein, high-fat (supports thick coat and large size)
Lifespan: 14–16 years
Weight: 12–16 lbs (5.4–7.3 kg) – Females smaller
Distinct Features: Waterproof double coat, lynx-like ear tufts, bushy tail

What We Love About This Breed:
➤ Majestic "wild" appearance – built for Scandinavian winters with snowshoe paws
➤ Storybook charm – believed to be the inspiration for Viking fairy-tale cats
➤ Self-cleaning coat – despite length, mats rarely form thanks to guard hairs
➤ Moderate energy – playful but won’t scale your curtains like a Bengal

The Norwegian Forest Cat (or Wegie) is a natural breed developed over centuries in Norway’s harsh climate. Their triple-layered coat (dense undercoat, middle "awn" hairs, long waterproof guard hairs) sheds heavily in spring but requires only weekly brushing most of the year.

Unlike many large breeds, they mature slowly—reaching full size at 4–5 years old. Their personality balances:
✓ Independent hunter – excellent mouser
✓ Loyal companion – follows owners at a respectful distance
✓ Quiet communicator – soft chirps instead of loud meows

Health Notes: Prone to glycogen storage disease IV (reputable breeders test for this) and hip dysplasia in some lines.

Ideal For: Those wanting a low-drama, sturdy companion who enjoys snowy windowsills.

Viking Lore: Norse mythology claims the goddess Freya’s chariot was pulled by giant magical cats resembling Wegies', false, 'published', 'http://localhost:9000/static/1750049419266-Norwegian_Forest_Cat_PA-1024x717.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 00:50:19.639-04', '2025-06-16 00:50:19.639-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXJ4M528CAS984BCCGBR0HH', 'Pharaoh Hound', 'pharaoh-hound', NULL, 'Care Level: Moderate (exercise + mental stimulation essential)
Temperament: Noble, sensitive, athletic, cat-like grace
Diet: High-performance formula (lean muscle maintenance)
Lifespan: 12–14 years
Weight: 45–55 lbs (20–25 kg)
Distinct Features: Amber eyes, rose ears, sleek tan coat, "blushing" nose

What We Love About This Breed:
➤ "Living Anubis" – Ancient hunting companion depicted in Egyptian art
➤ Dazzling speed + grace – Built for coursing with aerodynamic elegance
➤ Emotional intelligence – Deeply attuned to owners, known to "smile" and blush
➤ Silent hunter – Rarely barks (communicates through expressive body language)

The Pharaoh Hound is sunlight incarnate—golden, warm, and radiantly alive:
✓ Glowing coat – Short, glossy, low-maintenance (rubber grooming mitt weekly)
✓ Aerodynamic build – Deep chest, tucked waist, springs into effortless gallop
✓ Unique "blush" – Nose/ears flush pink when excited or happy

Elite Traits (Primitive Purity):
✓ Unchanged for millennia – One of the least-altered ancient breeds
✓ Dual-purpose athlete – Excels in lure coursing, agility, and obedience
✓ Sensitive soul – Requires positive training methods (never harsh corrections)

Health Notes:
Exceptionally healthy but prone to allergies and exercise-induced collapse. Reputable breeders test for:

Hip dysplasia

Thyroid function

Cardiac screening

Ideal For:
✔ Active owners who enjoy hiking/running (leashed - strong prey drive)
✔ Sighthound enthusiasts wanting a more people-focused companion
✔ Those captivated by living history and sculptural beauty

Maltese Treasure: Though linked to Egypt, the breed was preserved for centuries in Malta as "Kelb tal-Fenek" (rabbit hunting dog). Their rediscovery in the 1960s captivated the dog world.', false, 'published', 'http://localhost:9000/static/1750117535260-feca870d4f37498719cc7b4d970737c0.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXEPDQJNHE7CY1A5QZ2R6NY', true, NULL, '2025-06-16 19:45:36.099-04', '2025-06-17 04:40:09.82-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVHERASP9P30CRGSNPBB8E3', 'Balinese', 'balinese', '', 'Care Level: Moderate (grooming + mental stimulation)
Temperament: Affectionate, talkative, acrobatic
Diet: High-protein (supports lean muscle)
Lifespan: 12–20 years
Weight: 6–11 lbs (2.7–5 kg)
Distinct Features: Flowing silky coat, sapphire-blue eyes, plumed tail

What We Love About This Breed:
➤ "Longhaired Siamese" – all the brains and beauty without excessive vocalization
➤ Feather-light fur – lacks undercoat, so less prone to matting than typical longhairs
➤ Olympic-level jumper – effortlessly leaps to high shelves and door tops
➤ Emotionally intuitive – senses and responds to owner’s moods

The Balinese is essentially a mutated Siamese—their long coat resulted from a spontaneous recessive gene in purebred Siamese litters. Unlike the stockier Himalayan, they retain the sleek, tubular body of their shorthaired cousins with added elegance from their semi-long, silky fur.

Coat maintenance is surprisingly easy:

Weekly combing with a stainless steel comb

No trimming needed – fur naturally forms a neat "V" along the body

Minimal shedding compared to other longhairs

These cats are highly trainable—many learn to:
✓ Play fetch
✓ Walk on leashes
✓ Open puzzle feeders with dexterous paws

Health Notes: Prone to dental issues and same genetic conditions as Siamese (amyloidosis, heart defects).

Ideal For: Active owners who want a vocal but not shrill companion with ballet-like grace.

Name Origin: Despite the tropical name, the breed was developed in 1950s America—their fluid movements reminded breeders of Balinese dancers', false, 'published', 'http://localhost:9000/static/1750049710323-Balinese_PA_Chanan-1024x877.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 00:55:10.434-04', '2025-06-16 00:55:10.434-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVJCT99K4RA6NXF46F9CXDD', 'Turkish Angora', 'turkish-angora', '', 'Care Level: Moderate (grooming + mental stimulation)
Temperament: Intelligent, playful, affectionate but dignified
Diet: High-quality protein (supports lean muscle)
Lifespan: 12–18 years
Weight: 5–9 lbs (2.3–4 kg) – Delicate-boned but athletic
Distinct Features: Silky semi-long coat, plume tail, often odd-eyed

What We Love About This Breed:
➤ Hypnotic eyes – frequently one blue/one amber (though both blue or gold also occur)
➤ Ballerina grace – moves with liquid elegance despite fluffy appearance
➤ Minimal undercoat – less prone to matting than other longhairs
➤ Historical prestige – ancestors were gifts to European royalty

The Turkish Angora is a natural breed originating from Ankara (formerly Angora), where they’ve been documented since the 15th century. Unlike the stockier Persian, they have a fine-boned, triangular face and a coat that feels like whipped silk rather than dense cotton.

Their personality blends:
✓ Dog-like loyalty – follows owners room-to-room
✓ Acrobatic playfulness – excels at feather toy chase
✓ Quiet charm – communicates with soft trills rather than loud meows

Coat Care Tips:

Brush 2x weekly with a stainless steel comb

No shaving needed – their single coat regulates temperature naturally

"Watershedding" – many love playing with water

Health Notes: Prone to hereditary ataxia (reputable breeders test for this) and deafness in white, blue-eyed cats.

Ideal For: Those wanting a regal but interactive companion that combines beauty with brains.

Cultural Legacy: Considered good luck in Turkey—Atatürk famously dreamed that a white odd-eyed Angora would bring prosperity', false, 'published', 'http://localhost:9000/static/1750050695191-Turkish-Angora1-1024x683.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 01:11:35.541-04', '2025-06-16 01:11:35.541-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVJPW1GT286TEJYTEAF3651', 'Egyptian Mau', 'egyptian-mau', '', 'Care Level: Moderate (needs mental & physical stimulation)
Temperament: Loyal, athletic, highly expressive
Diet: High-protein (obligate carnivore needs)
Lifespan: 12–15 years
Weight: 6–14 lbs (2.7–6.3 kg)
Distinct Features: Spotted coat, "worry lines" on forehead, gooseberry-green eyes

What We Love About This Breed:
➤ Only natural spotted domestic cat – no hybrid breeding involved
➤ Cheetah-like acceleration – fastest domestic cat (30 mph bursts!)
➤ "Mascara" markings – dramatic eyeliner and necklace-like stripes
➤ Temperature-sensitive coat – spots darken in cold weather

The Egyptian Mau is a living relic—genetic studies confirm their lineage dates back 3,000+ years, likely descending from African wildcats. Their name means "cat" in ancient Egyptian, and their naturally occurring spots (unlike Bengal hybrids) come in silver, bronze, smoke, or black.

Unique traits include:
✓ Belly flap – loose skin allows greater stride length for running
✓ Vocal trills – makes chirping sounds when excited
✓ Paw kneading – often "makes biscuits" while sucking on fabric

Care Requirements:

Weekly brushing (short coat is low-maintenance)

Secure outdoor access recommended (catios/leash walks ideal)

Interactive play essential – thrives on feather wands and puzzle toys

Health Notes: Prone to pyruvate kinase deficiency (PK-def) and cardiomyopathy – DNA testing available.

Ideal For: Active owners who want a dog-like, trainable cat with wild beauty.

Historical Tidbit: Maus appear in ancient tomb paintings—their spotted coats may have inspired the word "mau" seeing light through leaves.', false, 'published', 'http://localhost:9000/static/1750051024772-mau_Attributes-768x650.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 01:17:04.977-04', '2025-06-16 01:17:04.977-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVKRDZC5P2RBVXB8B83DQQF', 'Chausie', 'chausie', '', 'Care Level: High (expert-only, demanding needs)
Temperament: Highly active, intelligent, wild-at-heart
Diet: Raw or grain-free high-protein (mimics wild diet)
Lifespan: 12–14 years (F1–F3 generations may have shorter lifespans)
Weight: 15–25 lbs (6.8–11.3 kg) – Large, muscular build
Distinct Features: Tall, lean body, deep chest, lynx-like ears, ticking or solid coat

What Makes This Breed Unique:
➤ Hybrid vigor – Cross between domestic cats and jungle cats (Felis chaus)
➤ Athletic powerhouse – Leaps 8+ feet vertically, sprints like a cheetah
➤ Semi-wild charm – Retains some wild instincts (loves water, strong prey drive)
➤ Dog-like loyalty – Bonds intensely with one person, follows them everywhere

The Chausie Experience:
The Chausie is not a typical house cat—it’s a high-energy, intelligent hybrid that thrives in an enriched environment. These cats need:
✔ Large, secure spaces (catios or supervised outdoor access)
✔ Daily interactive play (fetch, puzzle toys, leash walks)
✔ Raw or high-meat diet (they have sensitive stomachs)
✔ Early socialization (critical for F1–F3 generations)

Coat & Colors:

Ticked tabby (like an Abyssinian but wilder)

Solid black (from jungle cat ancestry)

Short, dense fur – Requires minimal grooming

Health & Behavior Notes:
❗ F1–F3 generations (50%–12.5% wild blood) may have:

Stronger hunting instincts (not safe with small pets)

Higher energy needs (can become destructive if bored)

Potential GI sensitivity (raw diet recommended)

Ideal For: Experienced owners who want a wild-looking but (mostly) tame companion.

Did You Know?
The Chausie was developed in the 1990s to create a domestic cat with the jungle cat’s athleticism.

F4+ generations (less than 12.5% wild) are considered "domestic" but still retain high energy.', false, 'published', 'http://localhost:9000/static/1750052123522-any-other-chausie-owners-here-v0-w5tz3vghw93a1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 01:35:24.9-04', '2025-06-16 01:35:24.9-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXJFACMBTB252E63NFTJG99', 'Saluki', 'saluki', NULL, 'Saluki
Saluki (Royal Hound of Egypt)
Care Level: Moderate (exercise + delicate coat maintenance)
Temperament: Regal, gentle, independent yet deeply loyal
Diet: High-protein active breed formula (sensitive digestion common)
Lifespan: 12–14 years
Weight: 40–65 lbs (18–29 kg)
Distinct Features: Feathered ears, gazelle-like legs, soulful oval eyes

What We Love About This Breed:
➤ "The Desert Arrow" – One of the oldest known dog breeds, revered by Bedouins
➤ Poetry in motion – 45 mph sprinters with floating, effortless gait
➤ Quiet dignity – Less needy than other sighthounds, bonds profoundly with chosen humans
➤ Dual-coated beauty – Smooth or feathered varieties, both with satin texture

The Saluki is a desert mirage made flesh—ethereal yet enduring:
✓ Self-cleaning coat – Weekly brush maintains feathering (minimal doggy odor)
✓ Built for endurance – Deep chest houses legendary lung capacity
✓ Hypersensitive nature – Requires soft bedding and gentle handling

Ancient Traits (Unchanged for Millennia):
✓ Silent hunter – Pursues prey with eerie, soundless intensity
✓ Sun worshipper – Basks in warm spots like a cat
✓ Moonlight runner – Prefers exercising at dawn/dusk (heat sensitive)

Health Notes:
Remarkably healthy but prone to cardiac issues and autoimmune conditions. Elite breeders test for:

Heart (Holter monitor)

Thyroid

DNA for neuronal ceroid lipofuscinosis

Ideal For:
✔ Experienced owners who appreciate subtle canine communication
✔ Country homes with secure running space (invisible fencing ineffective)
✔ Those seeking a living art piece with a warrior''s spirit

Sacred History: Salukis were mummified alongside pharaohs, and Islamic tradition holds they''re "clean" animals unlike other dogs. Bedouins prized them above children, sharing goat milk with their hounds.', false, 'published', 'http://localhost:9000/static/1750117885986-bdc410386263b14ab7a93734cab8106c.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXEPDQJNHE7CY1A5QZ2R6NY', true, NULL, '2025-06-16 19:51:26.426-04', '2025-06-17 04:42:40.91-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVM9QW6YEFEY516ZKD6WCV9', 'Khao Manee', 'khao-manee', '', 'Care Level: Moderate (social needs are high)
Temperament: Affectionate, vocal, people-obsessed
Diet: High-quality protein (prone to food sensitivities)
Lifespan: 10–12 years
Weight: 8–10 lbs (3.6–4.5 kg)
Distinct Features: Pure white coat, odd-eyed (gold/blue), muscular yet elegant

What We Love About This Breed:
➤ "Diamond Eye Cat" – Ancient Thai name reflects their jewel-toned eyes
➤ Velvety short coat – Glows like polished marble in sunlight
➤ Extroverted personality – Thrives on constant interaction
➤ Musical voice – Soft, chirping meows unlike Siamese yowls

The Khao Manee is one of the rarest and most revered cats, historically kept by Thai royalty. Their genetic lineage traces back over 700 years, mentioned in the Tamra Maew (Cat-Book Poems). Unlike other white cats:
✓ Not albino – Eye colors develop by 4 weeks old
✓ Skin pigmentation varies – May have black nose leather or paw pads

Care Requirements:

Weekly ear checks (white cats prone to deafness)

Interactive play essential (puzzle feeders, feather toys)

Sun protection recommended (pink skin burns easily)

Health Notes:
❗ 20-30% of blue-eyed Khao Manees are deaf (unrelated to albinism)
❗ Prone to food allergies (limited-ingredient diets often needed)

Ideal For: Devoted owners who can provide near-constant companionship.

Royal History: King Rama V (1868–1910) documented his personal Khao Manees, refusing to export them to preserve purity.', false, 'published', 'http://localhost:9000/static/1750052691525-Khao_About_Chanan1.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 01:44:51.904-04', '2025-06-16 01:44:51.905-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVMVPGJ3TQ2A74WAKW85XN9', 'Korat', 'korat', '', 'Care Level: Moderate (sensitive to stress)
Temperament: Gentle, observant, deeply loyal
Diet: High-protein (small, frequent meals preferred)
Lifespan: 15–20 years
Weight: 6–10 lbs (2.7–4.5 kg) – Petite but muscular
Distinct Features: Silver-tipped blue coat, heart-shaped face, luminous green eyes

What We Love About This Breed:
➤ "Good luck cat" – Thai tradition says they bring prosperity (often given as wedding gifts)
➤ Singular coat color – Only accepted in silver-blue with no white markings
➤ Velvet fur – Feels like crushed silk with sparkling silver highlights
➤ Expressive eyes – Transition from amber to emerald green by age 2–4

The Korat is one of the oldest natural breeds, originating from Thailand''s Amphoe Korat region. Unlike the Russian Blue''s dense undercoat, their single-layered coat lies close to the body, requiring only weekly stroking with a damp cloth to maintain sheen.

Personality highlights:
✓ Forms intense bonds – Follows favorite humans like a shadow
✓ Quiet but communicative – Uses subtle body language and soft chirps
✓ Dislikes loud noises – Thrives in calm, predictable environments

Health Notes:
Prone to GM1/GM2 gangliosidosis (reputable breeders DNA test)
Sensitive to anesthesia – Requires vet experienced with Korats

Ideal For: Quiet households wanting a devoted, low-maintenance companion with celestial beauty.

Cultural Significance: Depicted in Thailand''s 13th-century Cat-Book Poems as "Si-Sawat" (color of sawat seed husks).', false, 'published', 'http://localhost:9000/static/1750053279674-Korat_SMall_Oscar_Silva1.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 01:54:40.406-04', '2025-06-16 01:54:40.406-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVNB6GYGRAKXKVBQZS0JBMG', 'Selkirk Rex', 'selkirk-rex', '', 'Care Level: Moderate (coat maintenance varies)
Temperament: Easygoing, affectionate, patient
Diet: Balanced diet (no special needs)
Lifespan: 10–15 years
Weight: 9–16 lbs (4–7 kg) – Stocky, heavy-boned
Distinct Features: Plush curly coat, round face, teddy-bear appearance

What We Love About This Breed:
➤ "Sheep in cat''s clothing" – Loose curls feel like crushed velvet
➤ Three coat types – Short/longhair + straight-haired variants possible in same litter
➤ Exceptionally tolerant – Ideal for families with kids/dogs
➤ Low-key clown – Playful but won’t scale your curtains

The Selkirk Rex is the only curly-coated breed with dominant genetics (one parent passes the trait). Unlike delicate Cornish Rex curls, their coat is:
✓ Dense and plush – Tight ringlets in kittens loosen into waves
✓ Weather-resistant – Originally bred from Montana barn cats
✓ Low-shedding – Weekly combing prevents mats (longhairs need more care)

Personality Perks:
✓ Adapts well to apartments
✓ Enjoys being handled (great therapy cats)
✓ Unfazed by noise/chaos

Health Notes:
Prone to polycystic kidney disease (PKD) – Reputable breeders screen
Weight management crucial (tendency to overeat)

Ideal For: First-time owners wanting a huggable, low-drama companion.

Genetic Quirk: The founding cat, Miss DePesto, was the only curly kitten in a 1987 Montana shelter litter!', false, 'published', 'http://localhost:9000/static/1750053787734-Selkirk-Rex_portrait1.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 02:03:08.264-04', '2025-06-16 02:03:08.264-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVNVQ9MWY7R50VJVT0WN96H', 'American Shorthair', 'american-shorthair', '', 'Care Level: Low (great for first-time owners)
Temperament: Easygoing, adaptable, friendly
Diet: Balanced diet (watch for weight gain)
Lifespan: 15–20 years
Weight: 10–15 lbs (4.5–6.8 kg) – Males larger
Distinct Features: Athletic build, round face, 80+ color/pattern options

What We Love About This Breed:
➤ Living history – Descended from 17th-century European working cats
➤ Classic "tabby" look – Silver tabby is most iconic (think "Whiskas cat")
➤ Self-sufficient – Enjoys affection but won’t demand constant attention
➤ Natural mousers – Retains strong hunting instincts

The American Shorthair is the all-American family cat, bred for health and temperament over centuries. Unlike highly engineered breeds, their medium-density coat requires only:
✓ Weekly brushing (more during seasonal sheds)
✓ Occasional nail trims
✓ Dental care (prone to gingivitis)

Personality Highlights:
✓ Gets along with kids/dogs
✓ Adapts to apartments or houses
✓ Playful but not destructive

Health Notes:
Generally robust – some lines prone to hypertrophic cardiomyopathy (HCM)

Ideal For: Busy households wanting a low-maintenance, long-lived companion.', false, 'published', 'http://localhost:9000/static/1750054329453-ShortHair_Chanan1-1024x682.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 02:12:09.825-04', '2025-06-16 02:12:09.825-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVP88D6QPVGWJV1QW79QXQ6', 'Birman', 'birman', '', 'Care Level: Moderate (grooming + companionship needs)
Temperament: Gentle, affectionate, quietly playful
Diet: High-quality dry/wet food (prone to weight gain)
Lifespan: 12–16 years
Weight: 8–12 lbs (3.6–5.4 kg)
Distinct Features: Sapphire-blue eyes, white "gloves," silky colorpoint coat

What We Love About This Breed:
➤ "Sacred Cat of Burma" – Legend says temple guardians’ souls inhabit them
➤ Striking contrast – Cream body with dark points + snowy white paws
➤ Silent charm – Communicates with soft mews and expressive eyes
➤ Dog-like devotion – Follows owners room-to-room without being clingy

The Birman strikes a perfect balance between Persian fluff and Siamese elegance. Their semi-long coat:
✓ Resists matting (unlike Persians)
✓ Minimal shedding – Brush 2–3x weekly
✓ Darkens with age – Kittens born white develop points by 2 years

Unique Traits:
✓ White gloves must be symmetrical (show standard)
✓ Puppy-like behavior – Many enjoy fetch
✓ Heat-sensitive coat – Points darken in cool rooms

Health Notes: Prone to hypertrophic cardiomyopathy (HCM) – Reputable breeders screen

Ideal For: Those wanting a calm, beautiful lap cat with mythical charm.', false, 'published', 'http://localhost:9000/static/1750054740146-Birman_Larry_Johnson2.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 02:19:00.469-04', '2025-06-16 02:19:00.469-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVQP6MX4BP79V9YWXG8F8C1', 'Bengal', 'bengal', 'Roserted', 'Care Level: High (needs expert handling + enrichment)
Temperament: Energetic, intelligent, water-loving
Diet: Raw/grain-free high-protein (mimics wild diet)
Lifespan: 12–16 years
Weight: 8–15 lbs (3.6–6.8 kg) – Athletic, muscular
Distinct Features: Rosetted/spotted coat, sleek body, "cheetah" stride

What Makes This Breed Unique:
➤ Wild heritage – Developed from Asian leopard cat hybrids (F1–F4 generations)
➤ Only domestic cat with rosettes – Like a mini leopard!
➤ Adores water – Will join you in showers/swim in pools
➤ Next-level intelligence – Opens doors, learns tricks, masters puzzle toys

The Bengal Experience:
These are not typical house cats—they’re high-octane athletes that need:
✔ Vertical space (cat shelves, tall trees)
✔ Daily interactive play (feather wands, fetch)
✔ Secure outdoor access (catios/leash walks ideal)
✔ Raw or high-meat diet (many have sensitive stomachs)

Coat & Patterns:

Spotted (arrowhead, pawprint, or donut shapes)

Marbled (swirling, clouded pattern)

Glitter gene (fur shimmers like gold dust)

Critical Considerations:
❗ F1–F3 generations (5%–12.5% wild blood) may:

Spray/mark territory

Be aloof with strangers

Have higher prey drive (unsafe with small pets)

❗ Prone to:

HCM (heart disease – breeders should screen)

Flat-chested kitten syndrome (in some lines)

Ideal For: Experienced owners who can provide jungle-like stimulation.', false, 'published', 'http://localhost:9000/static/1750056245041-Bengal_PA_Chanan.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 02:44:05.948-04', '2025-06-16 02:44:05.948-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXVS4T5JEJP3R21724X6ME7J', 'Somali', 'somali', '', 'Care Level: Moderate (grooming + playtime needs)
Temperament: Playful, curious, mischievously charming
