Prone to gingivitis (needs dental care) and pyruvate kinase deficiency (PK-def)

Ideal For: Active families wanting a gorgeous, interactive cat.', false, 'published', 'http://localhost:9000/static/1750057772346-SomaliRuddy2.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 03:09:33.287-04', '2025-06-16 03:09:33.288-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXW84VBFKNTGD61Q9N1T0DFR', 'Snowshoe', 'snowshoe', '', 'Care Level: Moderate (social needs are high)
Temperament: Affectionate, vocal, people-oriented
Diet: High-quality protein (balanced diet)
