INSERT INTO public.product VALUES ('prod_01JXW8XFTPYVJFS2E9YMT7WSK3', 'Chantilly', 'chantilly', 'tiffany', 'Care Level: Low to Moderate (gentle grooming)
Temperament: Devoted, calm, softly spoken
Diet: High-quality protein (supports coat health)
Lifespan: 14–16 years
Weight: 8–12 lbs (3.6–5.4 kg)
Distinct Features: Semi-long silky coat, golden eyes, ruffled neck fur

What We Love About This Breed:
➤ "Velveteen Rabbit" coat – Silky semi-long fur that rarely mats
➤ Striking eye color – Deep amber to rich gold (no green allowed)
➤ Quiet elegance – Communicates with chirps rather than loud meows
➤ One-person cat – Forms deep bonds but remains polite with guests

The Chantilly/Tiffany (once called "Foreign Longhair") is a natural breed rediscovered in 1960s New York. Unlike the fluffier Persian:
✓ Single coat – Sheds less and needs only bi-weekly combing
✓ No undercoat – Ideal for allergy sufferers
✓ Chocolate/lilac hues – Coat darkens with age like fine wine

Personality Perks:
✓ Lap cat extraordinaire – Stays put for movie marathons
✓ Gentle with children – Rarely extends claws
✓ Obsessed with feather toys – Retains playful streak into adulthood

Health Notes:
Exceptionally healthy – no known genetic predispositions

Ideal For: Those wanting a low-maintenance, affectionate companion.

Name Controversy: Originally called "Tiffany," renamed "Chantilly" in the 1990s to avoid confusion with the Asian Tiffanie.', false, 'published', 'http://localhost:9000/static/1750074307411-53d5b4ff13f3ce8eb40bad7fa4de4395.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXV5P93M542GG4XGDDRDWFPF', true, NULL, '2025-06-16 07:45:10.959-04', '2025-06-16 07:46:18.978-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXT358T9ZN1KMD8J4F9GTZ31', 'Leachianus Gecko', 'leachianus-gecko', 'New Caledonian Giant Gecko', 'Meet the Leachianus Gecko, or New Caledonian Giant Gecko – the world''s largest living gecko species. These impressive reptiles are celebrated for their substantial size, unique mottled patterns, and relatively docile nature. A nocturnal creature, the Leachianus Gecko can be a long-term companion, often living for 15-20 years with proper care.', false, 'published', 'http://localhost:9000/static/1750001164737-rhacodactylus-leachianus-commonly-known-as-the-new-v0-nj8qidpuspea1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, NULL, '2025-06-15 11:26:05.228-04', '2025-06-16 18:22:56.683-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXJQEXQ2D5APTQA92AKJ7WV', 'Japanese Akita', 'japanese-akita', NULL, 'Japanese Akita (Akita Inu)
Care Level: Moderate to High (grooming + experienced handling)
Temperament: Dignified, loyal, reserved with strangers, deeply bonded to family
Diet: High-quality large-breed formula (joint support essential)
Lifespan: 10–15 years
Weight: 70–130 lbs (32–59 kg) – Males significantly larger
Distinct Features: Fox-like face, curled tail, plush double coat, triangular ears

What We Love About This Breed:
➤ "Snow Country Samurai" – National treasure of Japan, symbolizing good health and fortune
➤ Quiet devotion – Expresses love through subtle gestures (leaning, watchful presence)
➤ Cat-like grace – Fastidious self-groomer, moves with surprising lightness
➤ Seasonal beauty – Coat changes dramatically between summer/winter

The Japanese Akita is a poem in canine form—spare, profound, and powerfully elegant:
✓ Self-maintaining coat – Brushing 2-3x weekly (daily during seasonal blows)
✓ Weatherproof design – Thick undercoat sheds water/snow effortlessly
✓ Color purity – Red, white, or brindle with "urajiro" whitish markings

Sacred Traits (Preserved for Centuries):
✓ Silent guardian – Rarely barks, uses body language to communicate
✓ One-family dog – Forms lifelong bonds, often aloof with outsiders
✓ Snow specialist – Loves cold weather, will sleep buried in snow

Health Notes:
Prone to hip dysplasia, autoimmune disorders, and VKH (eye/skin condition). Reputable breeders screen for:

OFA hips/elbows

Thyroid levels

DNA for degenerative myelopathy

Ideal For:
✔ Discerning owners who respect Japanese breed standards (no crossbreeding)
✔ Homes with secure outdoor space (strong prey drive)
✔ Those seeking a reverent, meditative companionship

Spiritual Legacy: Akitas were bred to hunt bears in snowy mountains, later kept by samurai. The famous Hachikō statue immortalizes their loyalty. Traditional Japanese homes display Akita figurines as symbols of protection.', false, 'published', 'http://localhost:9000/static/1750118152918-733aebb34eec3c5f7f964dedefbdea10.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXEPDQJNHE7CY1A5QZ2R6NY', true, NULL, '2025-06-16 19:55:53.244-04', '2025-06-17 04:45:18.649-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXGM7AQN0E6F0TJYBC21ZGM', 'Samoyed', 'samoyed', NULL, 'Care Level: High (intensive grooming + active lifestyle needed)
Temperament: Friendly, mischievous, social, "eternal puppy" energy
Diet: High-quality active breed formula (prone to weight gain if sedentary)
