➤ "The Arctic’s Sunshine Dog" – Bred to work alongside Siberian nomads, radiating joy
➤ Famous "Sammy Smile" – Upturned lips prevent drooling & create perpetual happy face
➤ Social butterfly – Loves everyone (including strangers—terrible guard dog!)
