✔ Cold climate dwellers or dedicated indoor/AC environments



Bonus Fact: Their coat was historically used to weave warm clothing—like living yarn!', false, 'published', 'http://localhost:9000/static/1750115949551-samoyed-green-background-692737423-39814766cd264a6fae5309cdcf2745f0.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXEPDQJNHE7CY1A5QZ2R6NY', true, NULL, '2025-06-16 19:19:10.018-04', '2025-06-17 04:29:19.886-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXH37QPGMQX8ZVN2SR2KX6K', 'Löwchen', 'lowchen', NULL, 'Care Level: Moderate (regular grooming + companionship needs)
