INSERT INTO public.product VALUES ('prod_01JXXQP31AACE0VVZ49P3PMYEB', 'Thai Ridgeback', 'thai-ridgeback', NULL, 'Care Level: ★★★★☆ (needs experienced handling + high activity)
Temperament: Cat software on dog hardware – aloof but fiercely loyal
Energy Level: Cheetah crossed with a cuddly sphinx (selective bursts)
Lifespan: 12–15 years
Weight: 35–75 lbs (16–34 kg)
Signature Traits: Sword-like ridge along the back, bat-like ears, sleek athletic build

Why Thai Ridgeback Owners Are Chosen (Not the Other Way Around):
➤ "I Allow You to Live Here" – Ancient breed that considers itself your equal (at minimum)
➤ "Ninja Mode Activated" – Moves with unsettling silence until crashing into furniture at 3AM
➤ "Personal Space? Never Heard of Her" – Will become your 45lb weighted blanket without consent
➤ "The Original Houdini" – If there’s a 2-inch gap in your fence, consider it an open invitation

Reality Check (From the Bleeding but Devoted):
✓ Training: Exceptionally smart – will learn commands then decide if they’re worth obeying
✓ Exercise: Requires sprint sessions, not walks (think "cheetah enrichment program")
✓ Grooming: Short coat = low maintenance (but sheds needles that embed in furniture)
✓ Social Skills: Forms one-family bonds; judges all outsiders silently from across the room

Primitive Breed Perks:
▪ Self-cleaning mode: Fastidious as cats (often grooms themselves)
▪ Heat-resistant: Thrives in tropical climates (will steal your fan spot)
▪ Ridge magic: That signature stripe is actually made of stubbornness and ancient DNA

Ideal Human:
✔ Former malinois/shiba owners looking for their next life challenge
✔ People who enjoy interpretive dance (their zoomies are performance art)
✔ Those who want a living relic – this breed’s bloodlines trace back over 1,000 years

Warning: Not a pet – a four-legged philosopher-warrior that tolerates your existence. Comes with eerie intelligence, zero chill, and a PhD in side-eye.

Final Verdict: If a dingo, a sphinx cat, and a samurai sword had a baby, you’d get this breathtakingly beautiful, infuriatingly smart, utterly unique primitive breed.

Ancient Wisdom: Their ridge was believed to deflect evil spirits. Modern science confirms it actually deflects unwanted commands. Same difference. 🐅', false, 'published', 'http://localhost:9000/static/1750123350717-cf87ce5aa94db0ac6e1dad68292e428b.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXXEPDQJNHE7CY1A5QZ2R6NY', true, NULL, '2025-06-16 21:22:31.756-04', '2025-06-17 02:34:17.131-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXXQFHBXGE8CXR7WWPX5RGQB', 'Miniature Bull Terrier', 'miniature-bull-terrier', NULL, 'Care Level: ★★★★☆ (moderate but needs experienced handling)
Temperament: Clown + Tank hybrid with a PhD in stubbornness
Energy Level: 0 to 60mph in 3 seconds (then crashes on your lap)
Lifespan: 11–14 years
Weight: 18–28 lbs (8–13 kg)
Signature Traits: Egg-shaped head, triangular eyes, muscular compact body

