➤ "Living Art Nouveau" – Neon-green scales with black rosettes like stained glass
➤ Primate-Level Agility – Uses its prehensile tail as a fifth limb while climbing
➤ Unusual Intelligence – Recognizes keepers and investigates surroundings with curiosity
➤ Semi-Social Unicorn – One of the few monitor species occasionally kept in pairs

Vital Stats:
✨ Size: 30-35 inches (75-90 cm) – Mostly tail
✨ Lifespan: 10-15 years (captive-bred)
✨ Care Level: ★★★★★ – Experts only
✨ Activity: ★★★★★ – Never stops exploring

Signature Traits:
✓ Rainforest Acrobat – Leaps between branches like a scaly trapeze artist
✓ Tongue-Flicking Detective – Samples air molecules constantly (like a snake)
✓ Color Morphs:

Classic Emerald (New Guinea lowlands)

Turquoise Phase (Biak Island)

Black & Green (Cape York locale)

Perfect For:
✔ Advanced herpetoculturists with tall, bioactive enclosures
✔ Those who want a "thinking" reptile with primate-like behaviors
✔ Keepers who enjoy high-maintenance display animals

Fun Fact:
Their forked blue tongues and vertical pupils make them look like miniature dragons—locals call them "tree crocodiles!"

Why Choose a Green Tree Monitor?
Imagine a pet that:

Moves like a velociraptor crossed with a squirrel

Requires an enclosure taller than your refrigerator

Turns feeding time into an aerial hunting spectacle

Not Just a Pet—A living, breathing rainforest ecosystem unto itself.', false, 'published', 'http://localhost:9000/static/1750177073127-c3635bcd27d611703443bdb7d1fb9557.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZ8CWHX4G720FNCP3AA3GCD', true, NULL, '2025-06-17 12:17:53.271-04', '2025-06-17 12:17:53.271-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXZBBP4NVN8NTEDNDHT80T6P', 'Caiman Lizard', 'caiman-lizard', '', 'Caiman Lizard (Dracaena guianensis)
The Armored Dragon of the Amazon

Why They Fascinate:
➤ "Living Fossil" – Prehistoric look with crocodilian scales and a flattened, paddle-like tail
➤ Snail Specialist – Uses powerful jaws to crush mollusks (their main wild diet)
➤ Semi-Aquatic Marvel – Equally at home swimming or basking on branches
➤ Shy Showstopper – Neon green with orange-red head, but prefers to avoid attention

Vital Stats:
✨ Size: 2-4 feet (60-120 cm) – Thick-bodied with a whip-like tail
✨ Lifespan: 10-15 years (captive)
✨ Care Level: ★★★★★ – Experts only (complex habitat needs)
✨ Activity: ★★☆☆☆ – Mostly lounges near water

Signature Traits:
✓ Built-In Armor – Osteoderms (bony scales) make them feel like living chainmail
✓ Nutcracker Jaws – Specialized molars for smashing shells
✓ Third Eyelid – Clear nictitating membrane protects eyes underwater

Perfect For:
✔ Advanced keepers who can replicate riverbank ecosystems
✔ Fans of oddball reptiles with specialized diets
✔ Those wanting a "hands-off" display animal

Fun Fact:
When threatened, they can detach their tail like some geckos—though it doesn’t regrow as perfectly!', false, 'published', 'http://localhost:9000/static/1750177536091-a44e0ee428c43f3ba246d4a82119cff2.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZ8CWHX4G720FNCP3AA3GCD', true, NULL, '2025-06-17 12:25:36.151-04', '2025-06-17 12:25:36.151-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXZBS9PCH14R40PZ3NY1W1V2', 'Black Dragon Water Monitor', 'black-dragon-water-monitor', '', 'Black Dragon Water Monitor (Varanus salvator ssp.)
The Shadow of the Swamps

Why They Command Awe:
➤ "Living Myth" – Jet-black morph of Asian water monitor resembling a creature from folklore
➤ Apex Athlete – 6+ feet of muscle built for swimming, climbing, and sprinting
➤ Primate-Level IQ – Recognizes individual humans and solves complex problems
➤ Semi-Aquatic Phantom – Glides through water like an anaconda, vanishes into mangroves

Vital Stats:
✨ Size: 5-7+ feet (1.5-2.1 m) – Some males reach 8ft
✨ Lifespan: 15-25 years (with expert care)
✨ Care Level: ★★★★★ – For professionals only
✨ Activity: ★★★★★ – Needs football-field space

Signature Traits:
✓ Obsidian Armor – Black scales absorb sunlight like solar panels
✓ Cobra-Like Alertness – Constantly scans environment while tongue-flicking
✓ Multi-Tool Tail – Whips for defense, rudders for swimming, props for climbing

Perfect For:
✔ Zoo-level facilities with custom aquatic enclosures
✔ Research institutions studying reptile intelligence
✔ Mythic reptile collectors (who prioritize animal welfare)

Fun Fact:
Wild individuals in Malaysia are known to raid fishing nets—locals call them "water tigers!"', false, 'published', 'http://localhost:9000/static/1750177982089-487ccecc04eb1ae6b19d0f9b15ef69c1.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZ8CWHX4G720FNCP3AA3GCD', true, NULL, '2025-06-17 12:33:02.163-04', '2025-06-17 12:33:02.163-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXZC4E1K078V3V8RY9HKER3E', 'Albino Iguana', 'albino-iguana', '', 'Albino Iguana (Green Iguana morph - Iguana iguana)
The Sun-Deprived Ghost of the Jungle

Why They Captivate (and Challenge):
➤ "Living Opal" – Translucent white-pink scales with ruby eyes (no melanin)
➤ Photosensitive Giant – Lacks UV-protective pigments (requires extreme habitat control)
➤ Rare Genetic Marvel – Only 1 in 10,000 green iguanas are true albinos
➤ High-Maintenance Royalty – Demands perfect conditions to thrive

Vital Stats:
✨ Size: 4-6 feet (1.2-1.8 m) – Tail makes up 2/3 length
✨ Lifespan: 12-15 years (with impeccable care)
✨ Care Level: ★★★★★ – Veterinary nightmare if mismanaged
✨ Activity: ★★★☆☆ – Arboreal acrobat (when healthy)

Albino-Specific Needs:
✓ UVB Shielding – Requires indirect UVB to prevent burns (no direct sun)
✓ Red-Tinted Enclosure – Helps protect photosensitive eyes
✓ Higher Humidity – 80%+ to prevent skin cracking

Perfect For:
✔ Specialist Herpetologists with climate-controlled rooms
✔ Zoo Breeding Programs preserving rare morphs
✔ Very Experienced Keepers (5+ years iguana experience)

Hard Truths:
Wild Lifespan: <2 years (predators spot them easily)

Common Captive Issues: Skin cancer, eye ulcers, metabolic bone disease

Ethical Note: Many suffer due to black market "designer pet" trade', false, 'published', 'http://localhost:9000/static/1750178347019-ba1af3501fe1fa759c4c720831096474.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZ8CWHX4G720FNCP3AA3GCD', true, NULL, '2025-06-17 12:39:07.063-04', '2025-06-17 12:39:07.063-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXZCVGNERZDV6VJ1QG33VPCE', 'Leucistic Nile Monitor', 'leucistic-nile-monitor', '', 'Sunglow Iguana
The Designer Dragon of the Reptile World

Why They Captivate (and Why They’re Controversial):
➤ "Living Sunset" – Vibrant orange-and-white morph selectively bred from albino and hypomelanistic traits
➤ Photosensitive Beauty – Lacks dark pigments, requiring strict UV/light management
➤ Rarity = Expense – Often priced $1,500–$5,000+ due to selective breeding demand
➤ Ethical Debate – Intensive line-breeding raises welfare concerns

Vital Stats:
✨ Size: 4–6 ft (1.2–1.8 m) – Long, whip-like tail included
✨ Lifespan: 10–15 years (with expert care)
✨ Care Level: ★★★★★ – Advanced keepers only
✨ Activity: ★★★☆☆ – Arboreal climber, loves basking

Specialized Needs:
✓ UVB Lighting – Must be carefully controlled to prevent burns (no direct sunlight)
✓ High Humidity – 70–80% to avoid dehydration and shedding issues
✓ Diet: Calcium-rich greens (collard, mustard) + limited fruit (watch for metabolic bone disease)

Perfect For:
✔ Expert Reptile Keepers – Prior iguana experience required
✔ Conservation Educators – Teaching responsible morph breeding
✔ Those Who Can Afford It – Enclosure setup alone can cost $2,000+

Hard Truths:
⚠️ Health Risks: Prone to skin cancer, eye issues, and bone deformities
⚠️ Not a Pet for Beginners – Even experienced keepers struggle with their needs
⚠️ Black Market Risk – Many are illegally wild-caught or poorly bred', false, 'published', 'http://localhost:9000/static/1750179103327-my-first-reptile-a-nile-monitor-v0-urtuiv7kg84f1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZ8CWHX4G720FNCP3AA3GCD', true, NULL, '2025-06-17 12:51:43.418-04', '2025-06-17 12:51:43.418-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXZE4PBJMF72K95008G29JJ0', 'Giant Sailfin Dragon', 'giant-sailfin-dragon', NULL, 'Giant Sailfin Dragon (Hydrosaurus pustulatus)
The Dinosaur of the Philippine Rivers

Why They Amaze (and Intimidate):
➤ "Living Stegosaurus" – Males develop a spectacular 3-4" dorsal sail for display
➤ Semi-Aquatic Marvel – Webbed feet propel them through water like mini-mosasaurus
➤ Size That Impresses – 3-4 ft long (90-120 cm), making them the largest agamid lizard
➤ Color-Changing Drama – Males shift from emerald green to black when threatened

Vital Stats:
✨ Size: Up to 4 ft (1.2 m) – 50% tail
✨ Lifespan: 15-20 years (captive)
✨ Care Level: ★★★★★ – Experts only
✨ Activity: ★★★★☆ – Swims, climbs, basks in cycles

Specialized Needs:
✓ Palace-Like Enclosure – Requires 8''x4''x6'' space with deep swimming area
✓ High Humidity Jungle – 80% humidity + 90°F (32°C) basking spots
✓ Diet: Omnivorous – Snails, fish, leafy greens, and occasional fruit

Perfect For:
✔ Advanced Herpetoculturists – Prior monitor/iguana experience recommended
✔ Public Aquarium Displays – Their grandeur deserves audience
✔ Conservation Advocates – Threatened by habitat loss in the wild

Hard Truths:
⚠️ Not a Pet – More like a "wetland ecosystem manager"
⚠️ Tail Whip Danger – Capable of breaking fingers when threatened
⚠️ Import Stress – Wild-caught specimens often arrive parasite-ridden', false, 'published', 'http://localhost:9000/static/1750180452670-56agp7z2fsc91.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZ8CWHX4G720FNCP3AA3GCD', true, NULL, '2025-06-17 13:14:12.727-04', '2025-06-17 13:15:01.687-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXZDEAVX8C9ZB7FBRNJRPEDY', 'Argus Monitor', 'argus-monitor', NULL, 'Argus Monitor (Varanus panoptes)
Care Level: Expert Only (highly demanding)
Temperament: Intelligent, curious, potentially aggressive
Diet: Whole prey (insects, rodents, fish, eggs)
Lifespan: 15–20 years
Size: 4–5 ft (1.2–1.5 m) – 2nd largest Australian monitor
Distinct Features: Gold/yellow spots, muscular build, forked tongue

What Makes This Monitor Unique:
➤ "Smartest lizard" contender – Solves puzzles, recognizes owners
➤ Extreme athleticism – Climbs, swims, digs (needs massive enclosure)
➤ Temperature-sensitive colors – Darkens when cold, brightens when basking
➤ Dual subspecies – V. p. horni (New Guinea) & V. p. panoptes (Australia)

Husbandry Requirements:
✔ Enclosure: 8x4x6 ft (2.4x1.2x1.8 m) minimum – Must be escape-proof
✔ Basking spot: 130–150°F (55–65°C) – Critical for digestion
✔ Humidity: 60–80% (with swimming area)
✔ UVB lighting: 10.0+ T5 HO – Essential for calcium metabolism

Behavior Notes:
❗ Not "tame" – Even captive-bred specimens retain wild instincts
❗ Tail-whipping & bites – Can cause serious injury (use snake hooks for handling)
❗ Enrichment needed – Rotate climbing logs, dig boxes, scent trails

Health Concerns:
Gout (from improper diet)

MBD (Metabolic Bone Disease) – Without proper UV/calcium

Obesity – From overfeeding rodents

Ideal For: Advanced herpetologists with:

2+ years of large monitor experience

$3,000+ startup budget

No small pets/children in home

Wild Fact: In nature, they raid crocodile nests and eat hatchlings!', false, 'published', 'http://localhost:9000/static/1750179719978-argus-monitor-names-v0-03uw2k2catfe1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZ8CWHX4G720FNCP3AA3GCD', true, NULL, '2025-06-17 13:02:00.071-04', '2025-06-17 13:38:37.328-04', NULL, NULL);
INSERT INTO public.product VALUES ('prod_01JXTE1ATDG9H2SQ9PF9PFHR4N', 'Sunset Ball Python', 'sunset-ball-python', '', 'The Sunset Ball Python is a highly sought-after genetic morph prized for its incredibly vibrant and fiery coloration, featuring shades of orange, red, and yellow that create a stunning "sunset" effect. These docile and visually striking snakes are a premium choice for collectors looking for a truly unique and beautiful Ball Python.', false, 'published', 'http://localhost:9000/static/1750012570208-snakes-at-sunset-update-v0-b2rp5o5cgioc1.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ptyp_01JXZFQZ282EQYXMB8W62XNETA', true, NULL, '2025-06-15 14:36:10.482-04', '2025-06-17 13:42:43.289-04', NULL, NULL);


