INSERT INTO public.product_category VALUES ('pcat_01JXT0SGAW48X7Z2S8RWP1AVF2', 'Cats', 'At Pet Heaven, we specialize in offering a unique selection of exotic felines, bringing the beauty and allure of the wild into responsible, loving homes. Each of our cats is ethically sourced, health-checked, and raised with the utmost care to ensure a smooth transition to their new environment. Explore our categories to find the perfect extraordinary companion.', 'cat', 'pcat_01JXT0SGAW48X7Z2S8RWP1AVF2', true, false, 1, NULL, '2025-06-15 10:44:42.462-04', '2025-06-17 10:01:12.003-04', NULL, NULL);
