INSERT INTO public.product_category VALUES ('pcat_01JXT0YRTC2KZT1WYCMBRHD9JZ', 'Lizards', 'At Pet Heaven, we''re thrilled to introduce you to the captivating world of pet lizards! From docile ground-dwellers to vibrant arboreal climbers, our carefully selected lizards are sourced for health and temperament, making them ideal companions for both first-time reptile owners and experienced enthusiasts. Discover the perfect scaly friend to add an exotic touch to your home.', 'lizard', 'pcat_01JXT0YRTC2KZT1WYCMBRHD9JZ', true, false, 2, NULL, '2025-06-15 10:47:34.988-04', '2025-06-17 10:01:23.725-04', NULL, NULL);
INSERT INTO public.product_category VALUES ('pcat_01JXT1NQC32GV8KR6XANMDRFP5', 'Birds', 'At Pet Heaven, we believe that birds bring unparalleled joy, vibrant color, and cheerful melodies into any home. Our diverse selection of pet birds is carefully chosen for health and temperament, ensuring you find a delightful feathered friend ready to fill your life with song and personality. From charming finches to intelligent parrots, discover the perfect avian companion to brighten your days.', 'bird', 'pcat_01JXT1NQC32GV8KR6XANMDRFP5', true, false, 7, NULL, '2025-06-15 11:00:07.172-04', '2025-06-17 10:01:38.412-04', NULL, NULL);
INSERT INTO public.product_category VALUES ('pcat_01JXT0WMN2M8YM5E6M3HARBZZ8', 'Fishes', 'At Pet Heaven, we offer a dazzling array of live fish, perfect for adding tranquility, color, and life to any home or office. Our healthy, vibrant fish are carefully selected from trusted breeders and suppliers, ensuring they thrive in your aquarium. Whether you''re a first-time fish keeper or a seasoned aquarist, you''ll find the perfect aquatic companions in our diverse collection.', 'fish', 'pcat_01JXT0WMN2M8YM5E6M3HARBZZ8', true, false, 4, NULL, '2025-06-15 10:46:25.186-04', '2025-06-17 10:01:38.413-04', NULL, NULL);
INSERT INTO public.product_category VALUES ('pcat_01JXT10SZNDCN03JG43JQG4T66', 'Snakes', 'At Pet Heaven, we offer a captivating selection of pet snakes, renowned for their mesmerizing beauty, unique behaviors, and diverse range of sizes and temperaments. Each of our snakes is responsibly sourced, health-screened, and accustomed to captive environments, ensuring a smooth transition to your care. Whether you''re a first-time reptile enthusiast or an experienced keeper, you''ll find a healthy and intriguing serpent companion here.', 'snakes', '', true, false, 3, NULL, '2025-06-15 10:48:41.717-04', '2025-06-17 10:01:38.428-04', NULL, NULL);
INSERT INTO public.product_category VALUES ('pcat_01JXXEZ0BRMG5NQR566TJVT1B1', 'Dogs', 'At Pet Heaven, we pride ourselves on curating an exceptional collection of dogs—from cherished family breeds to extraordinary exotic canines.
Each of our dogs is ethically sourced, meticulously health-screened, and raised with dedicated care to ensure they thrive in loving homes. Whether you seek a loyal companion or a rare breed, we unite passion with responsibility to deliver a seamless adoption experience.

Discover the perfect canine partner today.', 'dog', 'pcat_01JXXEZ0BRMG5NQR566TJVT1B1', true, false, 0, NULL, '2025-06-16 18:50:06.082-04', '2025-06-17 10:01:12.006-04', NULL, NULL);
INSERT INTO public.product_category VALUES ('pcat_01JXT12AQD7ND7BQ47EDTR9X66', 'Geckos', 'At Pet Heaven, we invite you to explore the enchanting world of geckos – a diverse and captivating group of lizards known for their incredible variety in appearance, fascinating behaviors, and often striking colors. From charming terrestrial explorers to vibrant arboreal acrobats, our healthy, ethically sourced geckos make wonderful, long-lived companions.', 'geckos', 'pcat_01JXT12AQD7ND7BQ47EDTR9X66', true, false, 5, NULL, '2025-06-15 10:49:31.63-04', '2025-06-17 10:01:38.413-04', NULL, NULL);
INSERT INTO public.product_category VALUES ('pcat_01JXT14Q93ADGRB59J0WGPSHY0', 'Turtles & Tortoises', 'At Pet Heaven, we celebrate the ancient and enduring charm of Turtles and Tortoises. These fascinating reptiles, with their iconic protective shells, offer a unique companionship and a window into the natural world. From active aquatic swimmers to gentle terrestrial grazers, our healthy and ethically sourced chelonians are ready to bring a touch of timeless tranquility and intriguing behavior to your home. Discover the perfect long-lived companion that will enrich your life for decades to come.', 'turtle', 'pcat_01JXT14Q93ADGRB59J0WGPSHY0', true, false, 6, NULL, '2025-06-15 10:50:50.019-04', '2025-06-17 10:01:38.414-04', NULL, NULL);


